30197400-0: "\u0412\u043B\u0430\u0436\u043D\u044B\u0435 \u0433\u0443\u0431\u043A\u0438 \u0434\u043B\u044F  \u043C\u0430\u0440\u043E\u043A"
30197500-1: "\u0421\u0443\u0440\u0433\u0443\u0447\u043D\u0430\u044F \u043F\u0435\u0447\u0430\u0442\u044C"
30197510-4: "\u041F\u0440\u0438\u043D\u0430\u0434\u043B\u0435\u0436\u043D\u043E\u0441\u0442\u0438 \u0434\u043B\u044F \u0441\u0443\u0440\u0433\u0443\u0447\u043D\u043E\u0439 \u043F\u0435\u0447\u0430\u0442\u0438"
30197600-2: "\u041E\u0431\u0440\u0430\u0431\u043E\u0442\u0430\u043D\u043D\u044B\u0435 \u0431\u0443\u043C\u0430\u0433\u0430 \u0438 \u043A\u0430\u0440\u0442\u043E\u043D"
30197610-5: "\u0421\u043E\u0431\u0440\u0430\u043D\u043D\u044B\u0435 \u0431\u0443\u043C\u0430\u0433\u0430 \u0438 \u043A\u0430\u0440\u0442\u043E\u043D"
30197620-8: "\u041F\u0438\u0441\u0447\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430"
30197621-5: "\u0411\u043B\u043E\u043A \u0431\u0443\u043C\u0430\u0433\u0438 \u0434\u043B\u044F \u0444\u043B\u0438\u043F\u0447\u0430\u0440\u0442\u0430"
30197630-1: "\u0411\u0443\u043C\u0430\u0433\u0430 \u0434\u043B\u044F \u043F\u0435\u0447\u0430\u0442\u0438"
30197640-4: "\u0421\u0430\u043C\u043E\u043A\u043E\u043F\u0438\u0440\u043E\u0432\u0430\u043B\u044C\u043D\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430 \u0438\u043B\u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u0442\u0438\u043F\u044B \u043A\u043E\u043F\u0438\u0440\u043E\u0432\u0430\u043B\u044C\u043D\u043E\u0439 \u0431\u0443\u043C\u0430\u0433\u0438"
30197641-1: "\u0422\u0435\u0440\u043C\u043E\u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043A\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430"
30197642-8: "\u0411\u0443\u043C\u0430\u0433\u0438 \u0434\u043B\u044F \u0444\u043E\u0442\u043E\u043A\u043E\u043F\u0438\u0440\u043E\u0432\u0430\u043B\u044C\u043D\u043E\u0439 \u0438 \u043A\u0441\u0435\u0440\u043E\u043A\u043E\u043F\u0438\u0440\u043E\u0432\u0430\u043B\u044C\u043D\u043E\u0439 \u0442\u0435\u0445\u043D\u0438\u043A\u0438"
30197643-5: "\u0411\u0443\u043C\u0430\u0433\u0438 \u0434\u043B\u044F \u0444\u043E\u0442\u043E\u043A\u043E\u043F\u0438\u0440\u043E\u0432\u0430\u043B\u044C\u043D\u043E\u0439 \u0442\u0435\u0445\u043D\u0438\u043A\u0438"
30197644-2: "\u0411\u0443\u043C\u0430\u0433\u0430 \u0434\u043B\u044F \u043A\u0441\u0435\u0440\u043E\u043A\u043E\u043F\u0438\u0440\u043E\u0432\u0430\u043B\u044C\u043D\u043E\u0439 \u0442\u0435\u0445\u043D\u0438\u043A\u0438"
30197645-9: "\u041A\u0430\u0440\u0442\u043E\u0447\u043A\u0430 \u0434\u043B\u044F \u043F\u0435\u0447\u0430\u0442\u0438"
30198000-3: "\u0410\u043F\u043F\u0430\u0440\u0430\u0442\u044B \u0434\u043B\u044F \u043B\u043E\u0442\u0435\u0440\u0435\u0438"
30198100-4: "\u0418\u0433\u0440\u043E\u0432\u044B\u0435 \u0430\u043F\u043F\u0430\u0440\u0430\u0442\u044B \u0441 \u0440\u044B\u0447\u0430\u0433\u043E\u043C"
30199000-0: "\u041A\u0430\u043D\u0446\u0435\u043B\u044F\u0440\u0441\u043A\u0438\u0435 \u0442\u043E\u0432\u0430\u0440\u044B \u0438 \u043F\u0440\u043E\u0447\u0438\u0435 \u0438\u0437\u0434\u0435\u043B\u0438\u044F \u0438\u0437 \u0431\u0443\u043C\u0430\u0433\u0438"
30199100-1: "\u0418\u043D\u0434\u0438\u0433\u043E, \u0441\u0430\u043C\u043E\u043A\u043E\u043F\u0438\u0440\u043E\u0432\u0430\u043B\u044C\u043D\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430, \u0431\u0443\u043C\u0430\u0436\u043D\u044B\u0435 \u0442\u0440\u0430\u0444\u0430\u0440\u0435\u0442\u044B \u0438 \u0431\u0443\u043C\u0430\u0433\u0430 \u0431\u0435\u0437  \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u043D\u0438\u044F \u043E\u043A\u0441\u0438\u0434\u043E\u0432 \u0443\u0433\u043B\u0435\u0440\u043E\u0434\u0430"
30199110-4: "\u0418\u043D\u0434\u0438\u0433\u043E"
30199120-7: "\u0421\u0430\u043C\u043E\u043A\u043E\u043F\u0438\u0440\u043E\u0432\u0430\u043B\u044C\u043D\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430"
30199130-0: "\u0411\u0443\u043C\u0430\u0433\u0430 \u0431\u0435\u0437 \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u043D\u0438\u044F \u043E\u043A\u0441\u0438\u0434\u043E\u0432 \u0443\u0433\u043B\u0435\u0440\u043E\u0434\u0430"
30199140-3: "\u0411\u0443\u043C\u0430\u0433\u0430 \u0434\u043B\u044F \u0442\u0440\u0430\u0444\u0430\u0440\u0435\u0442\u043E\u0432"
30199200-2: "\u041A\u043E\u043D\u0432\u0435\u0440\u0442\u044B, \u043F\u043E\u0447\u0442\u043E\u0432\u044B\u0435 \u043E\u0442\u043A\u0440\u044B\u0442\u044B\u043A\u0438 \u0438 \u043F\u043E\u0447\u0442\u043E\u0432\u044B\u0435 \u043E\u0442\u043A\u0440\u044B\u0442\u043A\u0438 \u0431\u0435\u0437 \u0440\u0438\u0441\u0443\u043D\u043A\u043E\u0432"
30199210-5: "\u041A\u0430\u0440\u0442\u043E\u0447\u043A\u0438 \u0434\u043B\u044F \u043F\u0438\u0441\u0435\u043C"
30199220-8: "\u041F\u043E\u0447\u0442\u043E\u0432\u044B\u0435 \u043E\u0442\u043A\u0440\u044B\u0442\u043A\u0438 \u0431\u0435\u0437 \u0440\u0438\u0441\u0443\u043D\u043A\u043E\u0432"
30199230-1: "\u041A\u043E\u043D\u0432\u0435\u0440\u0442\u044B"
30199240-4: "\u041A\u043E\u043C\u043F\u043B\u0435\u043A\u0442 \u0434\u043E\u0441\u0442\u0430\u0432\u043A\u0438"
30199300-3: "\u0422\u0438\u0441\u043D\u0435\u043D\u0430\u044F \u0438\u043B\u0438 \u043F\u0435\u0440\u0444\u043E\u0440\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430"
30199310-6: "\u0422\u0438\u0441\u043D\u0435\u043D\u0430\u044F \u0438\u043B\u0438 \u043F\u0435\u0440\u0444\u043E\u0440\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430 \u0434\u043B\u044F \u043F\u0435\u0447\u0430\u0442\u0438"
30199320-9: "\u0422\u0438\u0441\u043D\u0435\u043D\u0430\u044F \u0438\u043B\u0438 \u043F\u0435\u0440\u0444\u043E\u0440\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u0430\u044F \u043F\u0438\u0441\u0447\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430"
30199330-2: "\u041D\u0435\u043F\u0440\u0435\u0440\u044B\u0432\u043D\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430 \u0434\u043B\u044F \u043A\u043E\u043C\u043F\u044C\u044E\u0442\u0435\u0440\u043D\u044B\u0445 \u043F\u0440\u0438\u043D\u0442\u0435\u0440\u043E\u0432"
30199340-5: "\u041D\u0435\u043F\u0440\u0435\u0440\u044B\u0432\u043D\u044B\u0435 \u0444\u043E\u0440\u043C\u0443\u043B\u044F\u0440\u044B"
30199400-4: "\u041F\u0440\u043E\u0440\u0435\u0437\u0438\u043D\u0435\u043D\u043D\u0430\u044F \u0438\u043B\u0438 \u043A\u043B\u0435\u0439\u043A\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430"
30199410-7: "\u0421\u0430\u043C\u043E\u043A\u043B\u0435\u044F\u0449\u0430\u044F\u0441\u044F \u0431\u0443\u043C\u0430\u0433\u0430"
30199500-5: "\u0421\u043A\u043E\u0440\u043E\u0441\u0448\u0438\u0432\u0430\u0442\u0435\u043B\u0438, \u043F\u0430\u043F\u043A\u0438 \u0434\u043B\u044F \u043F\u0435\u0440\u0435\u043F\u0438\u0441\u043A\u0438, \u043A\u043B\u0430\u0441\u0441\u0438\u0444\u0438\u043A\u0430\u0442\u043E\u0440\u044B \u0438 \u0430\u043D\u0430\u043B\u043E\u0433\u0438\u0447\u043D\u0430\u044F \u043F\u0440\u043E\u0434\u0443\u043A\u0446\u0438\u044F"
30199600-6: "\u0421\u0435\u043F\u0430\u0440\u0430\u0442\u043E\u0440\u044B \u0434\u043B\u044F \u0431\u0443\u043C\u0430\u0433"
30199700-7: "\u0411\u0443\u043C\u0430\u0436\u043D\u0430\u044F \u043F\u0435\u0447\u0430\u0442\u043D\u0430\u044F \u043F\u0440\u043E\u0434\u0443\u043A\u0446\u0438\u044F, \u0437\u0430 \u0438\u0441\u043A\u043B\u044E\u0447\u0435\u043D\u0438\u0435\u043C \u0444\u043E\u0440\u043C\u0443\u043B\u044F\u0440\u043E\u0432"
30199710-0: "\u041F\u0435\u0447\u0430\u0442\u043D\u044B\u0435 \u043A\u043E\u043D\u0432\u0435\u0440\u0442\u044B"
30199711-7: "\u041F\u0435\u0447\u0430\u0442\u043D\u044B\u0435 \u043A\u043E\u043D\u0432\u0435\u0440\u0442\u044B \u0441 \u043E\u043A\u043D\u043E\u043C"
30199712-4: "\u041F\u0435\u0447\u0430\u0442\u043D\u044B\u0435 \u043A\u043E\u043D\u0432\u0435\u0440\u0442\u044B \u0431\u0435\u0437 \u043E\u043A\u043D\u0430"
30199713-1: "\u041F\u0435\u0447\u0430\u0442\u043D\u044B\u0435 \u043A\u043E\u043D\u0432\u0435\u0440\u0442\u044B \u0434\u043B\u044F \u0440\u0430\u0434\u0438\u043E\u0433\u0440\u0430\u0444\u0438\u0438"
30199720-3: "\u0411\u0443\u043C\u0430\u0433\u0430 \u0434\u043B\u044F \u043F\u0438\u0441\u0435\u043C"
30199730-6: "\u0412\u0438\u0437\u0438\u0442\u043D\u044B\u0435 \u043A\u0430\u0440\u0442\u043E\u0447\u043A\u0438"
30199731-3: "\u0412\u0438\u0437\u0438\u0442\u043D\u0438\u0446\u044B"
30199740-9: "\u041A\u0430\u0440\u0442\u043E\u0447\u043A\u0438 \u0434\u043B\u044F \u0431\u043B\u0430\u0433\u043E\u0434\u0430\u0440\u043D\u043E\u0441\u0442\u0438"
30199750-2: "\u041A\u0443\u043F\u043E\u043D\u044B"
30199760-5: "\u042D\u0442\u0438\u043A\u0435\u0442\u043A\u0438"
30199761-2: "\u042D\u0442\u0438\u043A\u0435\u0442\u043A\u0438 \u0441\u043E \u0448\u0442\u0440\u0438\u0445-\u043A\u043E\u0434\u0430\u043C\u0438"
30199762-9: "\u042D\u0442\u0438\u043A\u0435\u0442\u043A\u0438 \u0434\u043B\u044F \u0431\u0430\u0433\u0430\u0436\u0430"
30199763-6: "\u042D\u0442\u0438\u043A\u0435\u0442\u043A\u0438 \u0434\u043B\u044F \u0437\u0430\u0449\u0438\u0442\u044B \u043E\u0442 \u043A\u0440\u0430\u0436\u0438"
30199770-8: "\u0422\u0430\u043B\u043E\u043D\u044B \u043D\u0430 \u043F\u0438\u0442\u0430\u043D\u0438\u0435"
30199780-1: "\u041E\u0444\u0438\u0441\u043D\u0430\u044F \u0431\u0443\u043C\u0430\u0433\u0430"
30199790-4: "\u0420\u0430\u0441\u043F\u0438\u0441\u0430\u043D\u0438\u044F"
30199791-1: "\u0420\u0430\u0441\u043F\u0438\u0441\u0430\u043D\u0438\u044F \u043D\u0430\u0441\u0442\u0435\u043D\u043D\u044B\u0435"
30199792-8: "\u041A\u0430\u043B\u0435\u043D\u0434\u0430\u0440\u0438"
30199793-5: "\u0421\u0442\u043E\u0439\u043A\u0438 \u0434\u043B\u044F \u0440\u0430\u0441\u043F\u0438\u0441\u0430\u043D\u0438\u044F, \u043F\u043E\u0432\u0435\u0441\u0442\u043A\u0438, \u043E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u0439"
30200000-1: "\u041A\u043E\u043C\u043F\u044C\u044E\u0442\u0435\u0440\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0438 \u043F\u0440\u0438\u043D\u0430\u0434\u043B\u0435\u0436\u043D\u043E\u0441\u0442\u0438"
30210000-4: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u043E\u0431\u0440\u0430\u0431\u043E\u0442\u043A\u0438 \u0434\u0430\u043D\u043D\u044B\u0445 (\u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0430\u043F\u043F\u0430\u0440\u0430\u0442\u043D\u043E\u0433\u043E \u043E\u0431\u0435\u0441\u043F\u0435\u0447\u0435\u043D\u0438\u044F)"
30211000-1: "\u0426\u0435\u043D\u0442\u0440\u0430\u043B\u044C\u043D\u044B\u0439 \u043F\u0440\u043E\u0446\u0435\u0441\u0441\u043E\u0440"
30211100-2: "\u0421\u0443\u043F\u0435\u0440\u043A\u043E\u043C\u043F\u044C\u044E\u0442\u0435\u0440"
30211200-3: "\u041E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0446\u0435\u043D\u0442\u0440\u0430\u043B\u044C\u043D\u043E\u0439 \u0435\u0434\u0438\u043D\u0438\u0446\u044B"
30211300-4: "\u041A\u043E\u043C\u043F\u044C\u044E\u0442\u0435\u0440\u043D\u044B\u0435 \u043F\u043B\u0430\u0442\u0444\u043E\u0440\u043C\u044B"
30211400-5: "\u041A\u043E\u043C\u043F\u044C\u044E\u0442\u0435\u0440\u043D\u044B\u0435 \u043A\u043E\u043D\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u0438"
30211500-6: "\u0426\u0435\u043D\u0442\u0440\u0430\u043B\u044C\u043D\u044B\u0439 \u043F\u0440\u043E\u0446\u0435\u0441\u0441\u043E\u0440 (\u0426\u041F) \u0438\u043B\u0438 \u043F\u0440\u043E\u0446\u0435\u0441\u0441\u043E\u0440\u044B"
30212000-8: "\u041E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0434\u043B\u044F \u043C\u0438\u043D\u0438-\u043A\u043E\u043C\u043F\u044C\u044E\u0442\u0435\u0440\u043E\u0432"
30212100-9: "\u0426\u0435\u043D\u0442\u0440\u0430\u043B\u044C\u043D\u044B\u0435 \u043F\u0440\u043E\u0446\u0435\u0441\u0441\u043E\u0440\u044B \u0434\u043B\u044F \u043C\u0438\u043D\u0438-\u043A\u043E\u043C\u043F\u044C\u044E\u0442\u0435\u0440\u043E\u0432"
30213000-5: "\u041F\u0435\u0440\u0441\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0435 \u043A\u043E\u043C\u043F\u044C\u044E\u0442\u0435\u0440\u044B"
30213100-6: "\u041F\u043E\u0440\u0442\u0430\u0442\u0438\u0432\u043D\u044B\u0435 \u043A\u043E\u043C\u043F\u044C\u044E\u0442\u0435\u0440\u044B"
