33131120-4: "\u0418\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0434\u043B\u044F \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u043A\u0440\u0438\u043E\u0445\u0438\u0440\u0443\u0440\u0433\u0438\u0438, \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0437\u043E\u043D\u0434\u044B, \u044D\u043B\u0435\u0432\u0430\u0442\u043E\u0440\u044B \u0438 \u044D\u043A\u0441\u043A\u0430\u0432\u0430\u0442\u043E\u0440\u044B"
33131121-1: "\u0418\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0434\u043B\u044F \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u043A\u0440\u0438\u043E\u0445\u0438\u0440\u0443\u0440\u0433\u0438\u0438"
33131122-8: "\u041F\u0430\u0440\u043E\u0434\u043E\u043D\u0442\u043E\u0432\u044B\u0435 \u0437\u043E\u043D\u0434\u044B"
33131123-5: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u044D\u043B\u0435\u0432\u0430\u0442\u043E\u0440\u044B"
33131124-2: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u044D\u043A\u0441\u043A\u0430\u0432\u0430\u0442\u043E\u0440\u044B"
33131130-7: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043D\u0430\u043F\u0435\u0440\u0441\u0442\u043A\u0438 \u0438 \u0449\u0438\u043F\u0446\u044B"
33131131-4: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043D\u0430\u043F\u0435\u0440\u0441\u0442\u043A\u0438"
33131132-1: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0449\u0438\u043F\u0446\u044B"
33131140-0: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0437\u0435\u0440\u043A\u0430\u043B\u0430 \u0438 \u0441\u0432\u0435\u0440\u043B\u0430"
33131141-7: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0437\u0435\u0440\u043A\u0430\u043B\u0430"
33131142-4: "\u0418\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0434\u043B\u044F \u0440\u0430\u0441\u0448\u0438\u0440\u0435\u043D\u0438\u044F \u043A\u0430\u043D\u0430\u043B\u0430"
33131150-3: "\u0417\u043E\u043D\u0434\u044B \u0434\u043B\u044F \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043D\u0438\u044F, \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0434\u043B\u044F \u0443\u0434\u0430\u043B\u0435\u043D\u0438\u044F \u0437\u0443\u0431\u043D\u043E\u0433\u043E \u043A\u0430\u043C\u043D\u044F \u0438 \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0441 \u0433\u0440\u0430\u0434\u0443\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u043E\u0439 \u0448\u043A\u0430\u043B\u043E\u0439"
33131151-0: "\u0417\u043E\u043D\u0434\u044B \u0434\u043B\u044F \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043D\u0438\u044F"
33131152-7: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0434\u043B\u044F \u0443\u0434\u0430\u043B\u0435\u043D\u0438\u044F \u0437\u0443\u0431\u043D\u043E\u0433\u043E \u043A\u0430\u043C\u043D\u044F"
33131153-4: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0441 \u0433\u0440\u0430\u0434\u0443\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u043E\u0439 \u0448\u043A\u0430\u043B\u043E\u0439"
33131160-6: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043D\u043E\u0436\u043D\u0438\u0446\u044B \u0438 \u0441\u043A\u0430\u043B\u044C\u043F\u0435\u043B\u0438"
33131161-3: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043D\u043E\u0436\u043D\u0438\u0446\u044B"
33131162-0: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0441\u043A\u0430\u043B\u044C\u043F\u0435\u043B\u0438"
33131170-9: "\u0428\u043F\u0430\u0442\u0435\u043B\u0438, \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043F\u0438\u043D\u0446\u0435\u0442\u044B \u0438 \u043D\u043E\u0436\u0438 \u0434\u043B\u044F \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u0432\u043E\u0441\u043A\u0430"
33131171-6: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0430\u044F \u0448\u043F\u0430\u0442\u0435\u043B\u0438"
33131172-3: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043F\u0438\u043D\u0446\u0435\u0442\u044B"
33131173-0: "\u041D\u043E\u0436\u0438 \u0434\u043B\u044F \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u0432\u043E\u0441\u043A\u0430"
33131200-9: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0438\u0433\u043B\u044B \u0434\u043B\u044F \u043D\u0430\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u043D\u0438\u044F \u0448\u0432\u043E\u0432"
33131300-0: "\u041E\u0434\u043D\u043E\u0440\u0430\u0437\u043E\u0432\u044B\u0435 \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B"
33131400-1: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u0437\u043E\u043D\u0434"
33131500-2: "\u0418\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0434\u043B\u044F \u0443\u0434\u0430\u043B\u0435\u043D\u0438\u044F \u0437\u0443\u0431\u043E\u0432"
33131510-5: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0444\u0440\u0435\u0437\u044B"
33131600-3: "\u0418\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0434\u043B\u044F \u0437\u0443\u0431\u043D\u044B\u0445 \u043F\u043B\u043E\u043C\u0431"
33132000-4: "\u0417\u0443\u0431\u043D\u044B\u0435 \u0438\u043C\u043F\u043B\u0430\u043D\u0442\u0430\u0442\u044B"
33133000-1: "\u0410\u043A\u0441\u0435\u0441\u0441\u0443\u0430\u0440\u044B \u0434\u043B\u044F \u0437\u0443\u0431\u043D\u044B\u0445 \u0441\u043B\u0435\u043F\u043A\u043E\u0432"
33134000-8: "\u042D\u043D\u0434\u043E\u0434\u043E\u043D\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0430\u043A\u0441\u0435\u0441\u0441\u0443\u0430\u0440\u044B"
33135000-5: "\u041E\u0440\u0442\u043E\u0434\u043E\u043D\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0430\u043F\u043F\u0430\u0440\u0430\u0442\u044B"
33136000-2: "\u0412\u0440\u0430\u0449\u0430\u044E\u0449\u0438\u0435\u0441\u044F \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0438 \u0430\u0431\u0440\u0430\u0437\u0438\u0432\u043D\u044B\u0435 \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B"
33137000-9: "\u0410\u043A\u0441\u0435\u0441\u0441\u0443\u0430\u0440\u044B \u0434\u043B\u044F \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u043F\u0440\u043E\u0444\u0438\u043B\u0430\u043A\u0442\u0438\u043A\u0438"
33138000-6: "\u041F\u0440\u043E\u0434\u0443\u043A\u0442\u044B \u0434\u043B\u044F \u0441\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u043F\u0440\u043E\u0442\u0435\u0437\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0438 \u043F\u0435\u0440\u0435\u043C\u0435\u0449\u0435\u043D\u0438\u044F \u0437\u0443\u0431\u043E\u0432"
33138100-7: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043F\u0440\u043E\u0442\u0435\u0437\u044B"
33140000-3: "\u041C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u0435 \u0440\u0430\u0441\u0445\u043E\u0434\u043D\u044B\u0435 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u044B"
33141000-0: "\u041D\u0435\u0445\u0438\u043C\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u0435 \u0440\u0430\u0441\u0445\u043E\u0434\u043D\u044B\u0435 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u044B \u0438 \u0433\u0435\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0440\u0430\u0441\u0445\u043E\u0434\u043D\u044B\u0435 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u044B"
33141100-1: "\u041F\u0435\u0440\u0435\u0432\u044F\u0437\u043E\u0447\u043D\u044B\u0435 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u044B; \u0437\u0430\u0436\u0438\u043C\u044B, \u0448\u0432\u044B, \u043B\u0438\u0433\u0430\u0442\u0443\u0440\u044B"
33141110-4: "\u041F\u0435\u0440\u0435\u0432\u044F\u0437\u043E\u0447\u043D\u044B\u0435 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u044B"
33141111-1: "\u041F\u043B\u0430\u0441\u0442\u044B\u0440\u0438 (\u043A\u043B\u0435\u0439\u043A\u0438\u0435 \u043F\u0435\u0440\u0435\u0432\u044F\u0437\u043E\u0447\u043D\u044B\u0435 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u044B)"
33141112-8: "\u041F\u043B\u0430\u0441\u0442\u044B\u0440\u0438"
33141113-4: "\u0411\u0438\u043D\u0442\u044B"
33141114-2: "\u041C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0430\u044F \u043C\u0430\u0440\u043B\u044F"
33141115-9: "\u041C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0430\u044F \u0432\u0430\u0442\u0430"
33141116-6: "\u0422\u0430\u043C\u043F\u043E\u043D\u044B \u0438 \u043A\u043E\u043C\u043F\u0440\u0435\u0441\u0441\u044B"
33141117-3: "\u0412\u0430\u0442\u0430"
33141118-0: "\u041C\u0430\u0440\u043B\u0435\u0432\u044B\u0435 \u043A\u043E\u043C\u043F\u0440\u0435\u0441\u0441\u044B"
33141119-7: "\u041A\u043E\u043C\u043F\u0440\u0435\u0441\u0441\u044B"
33141120-7: "\u0417\u0430\u0436\u0438\u043C\u044B, \u0448\u0432\u044B, \u043B\u0438\u0433\u0430\u0442\u0443\u0440\u044B"
33141121-4: "\u0425\u0438\u0440\u0443\u0440\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0448\u0432\u044B"
33141122-1: "\u0425\u0438\u0440\u0443\u0440\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0437\u0430\u0436\u0438\u043C\u044B"
33141123-8: "\u041A\u043E\u043D\u0442\u0435\u0439\u043D\u0435\u0440\u044B \u0434\u043B\u044F \u0438\u0433\u043B"
33141124-5: "\u041B\u043E\u0442\u043A\u0438 \u0434\u043B\u044F \u043E\u0441\u0442\u0440\u044B\u0445 \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u043E\u0432"
33141125-2: "\u041C\u0430\u0442\u0435\u0440\u0438\u0430\u043B \u0434\u043B\u044F \u0445\u0438\u0440\u0443\u0440\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0448\u0432\u043E\u0432"
33141126-9: "\u041B\u0438\u0433\u0430\u0442\u0443\u0440\u044B"
33141127-6: "\u0420\u0430\u0441\u0441\u0430\u0441\u044B\u0432\u0430\u044E\u0449\u0438\u0435\u0441\u044F \u0433\u0435\u043C\u043E\u0441\u0442\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0430"
33141128-3: "\u0418\u0433\u043B\u044B \u0434\u043B\u044F \u043D\u0430\u043B\u043E\u0436\u0435\u043D\u0438\u044F \u0448\u0432\u043E\u0432"
33141200-2: "\u041A\u0430\u0442\u0435\u0442\u0435\u0440\u044B"
33141210-5: "\u0411\u0430\u043B\u043B\u043E\u043D\u043D\u044B\u0435 \u043A\u0430\u0442\u0435\u0442\u0435\u0440\u044B"
