42123700-4: "\u0426\u0435\u043D\u0442\u0440\u043E\u0431\u0435\u0436\u043D\u044B\u0435 \u043A\u043E\u043C\u043F\u0440\u0435\u0441\u0441\u043E\u0440\u044B"
42123800-5: "\u041A\u043E\u043C\u043F\u0440\u0435\u0441\u0441\u043E\u0440\u044B \u0434\u043B\u044F \u0433\u0440\u0430\u0436\u0434\u0430\u043D\u0441\u043A\u043E\u0439 \u0430\u0432\u0438\u0430\u0446\u0438\u0438"
42124000-4: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043D\u0430\u0441\u043E\u0441\u043E\u0432, \u043A\u043E\u043C\u043F\u0440\u0435\u0441\u0441\u043E\u0440\u043E\u0432, \u043C\u0430\u0448\u0438\u043D \u0438\u043B\u0438 \u0434\u043B\u044F \u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043B\u0435\u0439"
42124100-5: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u043C\u0430\u0448\u0438\u043D \u0438\u043B\u0438 \u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043B\u0435\u0439"
42124130-4: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u043F\u043D\u0435\u0432\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043C\u0430\u0448\u0438\u043D"
42124150-0: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0433\u0438\u0434\u0440\u0430\u0432\u043B\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043C\u0430\u0448\u0438\u043D \u0438\u043B\u0438 \u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043B\u0435\u0439"
42124170-6: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0440\u0435\u0430\u043A\u0442\u0438\u0432\u043D\u044B\u0445 \u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043B\u0435\u0439"
42124200-6: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043D\u0430\u0441\u043E\u0441\u043E\u0432 \u0438\u043B\u0438 \u0434\u043B\u044F \u043F\u043E\u0434\u044A\u0435\u043C\u043D\u0438\u043A\u043E\u0432 \u0436\u0438\u0434\u043A\u043E\u0441\u0442\u0435\u0439"
42124210-9: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0442\u043E\u043F\u043B\u0438\u0432\u043D\u044B\u0445 \u043D\u0430\u0441\u043E\u0441\u043E\u0432, \u0440\u0443\u0447\u043D\u044B\u0445 \u043D\u0430\u0441\u043E\u0441\u043E\u0432 \u0438 \u0431\u0435\u0442\u043E\u043D\u043E\u043D\u0430\u0441\u043E\u0441\u043E\u0432"
42124211-6: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0442\u043E\u043F\u043B\u0438\u0432\u043D\u044B\u0445 \u043D\u0430\u0441\u043E\u0441\u043E\u0432"
42124212-3: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0440\u0443\u0447\u043D\u044B\u0445 \u043D\u0430\u0441\u043E\u0441\u043E\u0432"
42124213-0: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0431\u0435\u0442\u043E\u043D\u043D\u044B\u0445 \u043D\u0430\u0441\u043E\u0441\u043E\u0432"
42124220-2: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043D\u0430\u0441\u043E\u0441\u043E\u0432 \u0441 \u0432\u043E\u0437\u0432\u0440\u0430\u0442\u043D\u043E-\u043F\u043E\u0441\u0442\u0443\u043F\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u043C \u043F\u0440\u0438\u043D\u0446\u0438\u043F\u043E\u043C \u0440\u0430\u0431\u043E\u0442\u044B"
42124221-9: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0433\u0438\u0434\u0440\u0430\u0432\u043B\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0433\u0440\u0443\u043F\u043F"
42124222-6: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043D\u0430\u0441\u043E\u0441\u043E\u0432-\u0434\u043E\u0437\u0430\u0442\u043E\u0440\u043E\u0432"
42124230-5: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043D\u0430\u0441\u043E\u0441\u043E\u0432 \u0441 \u0432\u0440\u0430\u0449\u0430\u0442\u0435\u043B\u044C\u043D\u043E-\u043B\u0438\u043D\u0435\u0439\u043D\u044B\u043C \u043F\u0440\u0438\u043D\u0446\u0438\u043F\u043E\u043C \u0440\u0430\u0431\u043E\u0442\u044B"
42124290-3: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0446\u0435\u043D\u0442\u0440\u043E\u0431\u0435\u0436\u043D\u044B\u0445 \u043D\u0430\u0441\u043E\u0441\u043E\u0432"
42124300-7: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0432\u043E\u0437\u0434\u0443\u0448\u043D\u044B\u0445 \u0438\u043B\u0438 \u0432\u0430\u043A\u0443\u0443\u043C\u043D\u044B\u0445 \u043D\u0430\u0441\u043E\u0441\u043E\u0432, \u0432\u043E\u0437\u0434\u0443\u0448\u043D\u044B\u0445 \u0438\u043B\u0438 \u0433\u0430\u0437\u043E\u0432\u044B\u0445 \u043A\u043E\u043C\u043F\u0440\u0435\u0441\u0441\u043E\u0440\u043E\u0432"
42124310-0: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0432\u043E\u0437\u0434\u0443\u0448\u043D\u044B\u0445 \u043D\u0430\u0441\u043E\u0441\u043E\u0432"
42124320-3: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0432\u0430\u043A\u0443\u0443\u043C\u043D\u044B\u0445 \u043D\u0430\u0441\u043E\u0441\u043E\u0432"
42124330-6: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0432\u043E\u0437\u0434\u0443\u0448\u043D\u044B\u0445 \u043A\u043E\u043C\u043F\u0440\u0435\u0441\u0441\u043E\u0440\u043E\u0432"
42124340-9: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0433\u0430\u0437\u043E\u0432\u044B\u0445 \u043A\u043E\u043C\u043F\u0440\u0435\u0441\u0441\u043E\u0440\u043E\u0432"
42130000-9: "\u041A\u0440\u0430\u043D\u044B, \u0432\u0435\u043D\u0442\u0438\u043B\u0438 \u0438 \u0430\u043D\u0430\u043B\u043E\u0433\u0438\u0447\u043D\u044B\u0435 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430"
42131000-6: "\u041A\u0440\u0430\u043D\u044B \u0438 \u0432\u0435\u043D\u0442\u0438\u043B\u0438"
42131100-7: "\u0412\u0435\u043D\u0442\u0438\u043B\u0438, \u0441 \u0440\u0430\u0441\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u0438\u0435\u043C \u043F\u043E \u0444\u0443\u043D\u043A\u0446\u0438\u044F\u043C"
42131110-0: "\u0426\u0435\u043D\u0442\u0440\u0430\u043B\u044C\u043D\u044B\u0439 \u0432\u0435\u043D\u0442\u0438\u043B\u044C \u0440\u0430\u0434\u0438\u0430\u0442\u043E\u0440\u043D\u043E\u0433\u043E \u043E\u0442\u043E\u043F\u043B\u0435\u043D\u0438\u044F"
42131120-3: "\u041A\u0440\u0430\u043D\u044B-\u0432\u0435\u043D\u0442\u0438\u043B\u0438"
42131130-6: "\u0420\u0435\u0433\u0443\u043B\u044F\u0442\u043E\u0440\u044B \u0442\u0435\u043C\u043F\u0435\u0440\u0430\u0442\u0443\u0440\u044B"
42131140-9: "\u041A\u043B\u0430\u043F\u0430\u043D\u044B \u0441\u0431\u0440\u043E\u0441\u0430 \u0434\u0430\u0432\u043B\u0435\u043D\u0438\u044F, \u043A\u043B\u0430\u043F\u0430\u043D\u044B \u0440\u0435\u0433\u0443\u043B\u0438\u0440\u043E\u0432\u043A\u0438 \u0434\u0430\u0432\u043B\u0435\u043D\u0438\u044F, \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u0430\u043D\u0438\u044F \u0434\u0430\u0432\u043B\u0435\u043D\u0438\u044F \u0438 \u043F\u0440\u0435\u0434\u043E\u0445\u0440\u0430\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u043A\u043B\u0430\u043F\u0430\u043D\u044B"
42131141-6: "\u041A\u043B\u0430\u043F\u0430\u043D\u044B \u0441\u0431\u0440\u043E\u0441\u0430 \u0434\u0430\u0432\u043B\u0435\u043D\u0438\u044F"
42131142-3: "\u0412\u0435\u043D\u0442\u0438\u043B\u0438 \u0440\u0435\u0433\u0443\u043B\u0438\u0440\u043E\u0432\u043A\u0438 \u0434\u0430\u0432\u043B\u0435\u043D\u0438\u044F"
42131143-0: "\u0412\u0435\u043D\u0442\u0438\u043B\u0438 \u0434\u043B\u044F \u0440\u0435\u0433\u0443\u043B\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0437\u0430\u0442\u043E\u043F\u043B\u0435\u043D\u0438\u044F"
42131144-7: "\u0420\u0435\u0433\u0443\u043B\u0438\u0440\u0443\u044E\u0449\u0438\u0435 \u0432\u0435\u043D\u0442\u0438\u043B\u0438"
42131145-4: "\u041E\u0431\u0440\u0430\u0442\u043D\u044B\u0435 \u043A\u043B\u0430\u043F\u0430\u043D\u044B"
42131146-1: "\u041A\u043B\u0430\u043F\u0430\u043D\u044B \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u0430\u043D\u0438\u044F \u0434\u0430\u0432\u043B\u0435\u043D\u0438\u044F"
42131147-8: "\u041F\u0440\u0435\u0434\u043E\u0445\u0440\u0430\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u043A\u043B\u0430\u043F\u0430\u043D\u044B"
42131148-5: "\u0417\u0430\u043F\u043E\u0440\u043D\u044B\u0439 \u043A\u043B\u0430\u043F\u0430\u043D"
42131150-2: "\u041A\u043B\u0430\u043F\u0430\u043D\u044B \u0434\u043B\u044F \u043F\u043E\u0434\u044A\u0435\u043C\u043D\u044B\u0445 \u043A\u043E\u043B\u043E\u043D\u043D"
42131160-5: "\u0413\u0438\u0434\u0440\u0430\u043D\u0442\u044B"
42131170-8: "\u0412\u0435\u043D\u0442\u0438\u043B\u0438 \u0434\u043B\u044F \u0433\u0430\u0437\u043E\u0432\u044B\u0445 \u0431\u0430\u043B\u043B\u043E\u043D\u043E\u0432"
42131200-8: "\u041A\u043B\u0430\u043F\u0430\u043D\u044B, \u0441 \u0440\u0430\u0441\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u0438\u0435\u043C \u043F\u043E \u0442\u0438\u043F\u0443 \u043F\u0440\u043E\u0438\u0437\u0432\u043E\u0434\u0441\u0442\u0432\u0430"
42131210-1: "\u041D\u043E\u0436\u0435\u0432\u044B\u0435 \u0437\u0430\u0434\u0432\u0438\u0436\u043A\u0438"
42131220-4: "\u0420\u0435\u0433\u0443\u043B\u0438\u0440\u043E\u0432\u043E\u0447\u043D\u044B\u0435 \u043A\u043B\u0430\u043F\u0430\u043D\u044B"
42131230-7: "\u0420\u0430\u0437\u0434\u0432\u0438\u0436\u043D\u044B\u0435 \u043A\u0440\u0430\u043D\u044B"
42131240-0: "\u0428\u0430\u0440\u043E\u0432\u044B\u0435 \u043A\u0440\u0430\u043D\u044B"
42131250-3: "\u0418\u0433\u043E\u043B\u044C\u0447\u0430\u0442\u044B\u0435 \u043A\u043B\u0430\u043F\u0430\u043D\u044B"
42131260-6: "\u0428\u0430\u0440\u0438\u043A\u043E\u0432\u044B\u0435 \u043A\u043B\u0430\u043F\u0430\u043D\u044B"
42131270-9: "\u041A\u043E\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0432\u0435\u043D\u0442\u0438\u043B\u0438"
42131280-2: "\u0414\u0438\u0441\u043A\u043E\u0432\u044B\u0435 \u043F\u043E\u0432\u043E\u0440\u043E\u0442\u043D\u044B\u0435 \u0437\u0430\u0442\u0432\u043E\u0440\u044B"
42131290-5: "\u041C\u0435\u043C\u0431\u0440\u0430\u043D\u043D\u044B\u0435 \u043A\u043B\u0430\u043F\u0430\u043D\u044B"
42131291-2: "\u0420\u0430\u0441\u043F\u0440\u0435\u0434\u0435\u043B\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u044F\u0449\u0438\u043A\u0438"
42131292-9: "\u041E\u0442\u043A\u0438\u0434\u043D\u044B\u0435 \u043A\u043B\u0430\u043F\u0430\u043D\u044B"
42131300-9: "\u0424\u043E\u043D\u0442\u0430\u043D\u043D\u0430\u044F \u0430\u0440\u043C\u0430\u0442\u0443\u0440\u0430 \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u0432\u0435\u043D\u0442\u0438\u043B\u0438 \u0432 \u0441\u0431\u043E\u0440\u0435"
42131310-2: "\u0424\u043E\u043D\u0442\u0430\u043D\u043D\u0430\u044F \u0430\u0440\u043C\u0430\u0442\u0443\u0440\u0430"
42131320-5: "\u0414\u0440\u043E\u0441\u0441\u0435\u043B\u044C\u043D\u044B\u0435 \u043C\u0430\u043D\u0438\u0444\u043E\u043B\u044C\u0434\u044B"
42131390-6: "\u0412\u0435\u043D\u0442\u0438\u043B\u0438 \u0432 \u0441\u0431\u043E\u0440\u0435"
42131400-0: "\u041A\u0440\u0430\u043D\u044B \u0438 \u0432\u0435\u043D\u0442\u0438\u043B\u0438 \u0434\u043B\u044F \u0441\u0430\u043D\u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F"
42132000-3: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043A\u0440\u0430\u043D\u043E\u0432 \u0438 \u0432\u0435\u043D\u0442\u0438\u043B\u0435\u0439"
42132100-4: "\u041C\u0435\u0445\u0430\u043D\u0438\u0437\u043C\u044B \u043F\u0440\u0438\u0432\u043E\u0434\u0430 \u043A\u043B\u0430\u043F\u0430\u043D\u043E\u0432"
