42417230-3: "\u0417\u0430\u0431\u043E\u0439\u043D\u044B\u0435 \u0441\u043A\u0440\u0435\u0431\u043A\u043E\u0432\u044B\u0435 \u043A\u043E\u043D\u0432\u0435\u0439\u0435\u0440\u044B \u0434\u043B\u044F \u0448\u0430\u0445\u0442"
42417300-5: "\u0422\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0435\u0440\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42417310-8: "\u041A\u043E\u043D\u0432\u0435\u0439\u0435\u0440\u043D\u044B\u0435 \u043B\u0435\u043D\u0442\u044B"
42418000-9: "\u041F\u043E\u0434\u044A\u0435\u043C\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435, \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0434\u043B\u044F \u043F\u0435\u0440\u0435\u043C\u0435\u0449\u0435\u043D\u0438\u044F, \u043F\u043E\u0433\u0440\u0443\u0437\u043A\u0438 \u0438\u043B\u0438 \u0440\u0430\u0437\u0433\u0440\u0443\u0437\u043A\u0438"
42418100-0: "\u0412\u0430\u0433\u043E\u043D\u043E\u0442\u043E\u043B\u043A\u0430\u0442\u0435\u043B\u0438 \u0438 \u043B\u043E\u043A\u043E\u043C\u043E\u0442\u0438\u0432\u044B \u0438\u043B\u0438 \u0433\u043E\u0440\u043D\u043E\u0434\u043E\u0431\u044B\u0432\u0430\u044E\u0449\u0438\u0435 \u043F\u043E\u0432\u043E\u0440\u043E\u0442\u043D\u044B\u0435 \u043A\u0440\u0443\u0433\u0438"
42418200-1: "\u041C\u043E\u043D\u043E\u0440\u0435\u043B\u044C\u0441 \u0438 \u043B\u0435\u0431\u0435\u0434\u043A\u0438 \u0441 \u043D\u0430\u043A\u043B\u043E\u043D\u043D\u044B\u043C \u0436\u0435\u043B\u043E\u0431\u043E\u043C"
42418210-4: "\u041F\u043E\u0434\u0432\u0435\u0441\u043D\u044B\u0435 \u043C\u043E\u043D\u043E\u0440\u0435\u043B\u044C\u0441\u043E\u0432\u044B\u0435 \u0434\u043E\u0440\u043E\u0433\u0438"
42418220-7: "\u041A\u0440\u0435\u0441\u0435\u043B\u044C\u043D\u044B\u0435 \u043F\u043E\u0434\u044A\u0435\u043C\u043D\u0438\u043A\u0438"
42418290-8: "\u041B\u0435\u0431\u0435\u0434\u043A\u0438 \u0434\u043B\u044F \u043D\u0430\u043A\u043B\u043E\u043D\u043D\u043E\u0439 \u043F\u043B\u043E\u0441\u043A\u043E\u0441\u0442\u0438"
42418300-2: "\u041E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0434\u043B\u044F \u0443\u0442\u0438\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u0433\u0430\u0437\u043E\u043E\u0431\u0440\u0430\u0437\u043D\u044B\u0445 \u043E\u0441\u0442\u0430\u0442\u043A\u043E\u0432"
42418400-3: "\u0412\u0440\u0430\u0449\u0430\u044E\u0449\u0438\u0435\u0441\u044F \u043C\u0435\u0445\u0430\u043D\u0438\u0437\u043C\u044B \u0440\u0430\u0437\u043C\u0435\u0449\u0435\u043D\u0438\u044F \u0438 \u0432\u044B\u0435\u043C\u043A\u0438"
42418500-4: "\u041C\u0435\u0445\u0430\u043D\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u043F\u043E\u0433\u0440\u0443\u0437\u043E\u0447\u043D\u043E-\u0440\u0430\u0437\u0433\u0440\u0443\u0437\u043E\u0447\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42418900-8: "\u041F\u043E\u0433\u0440\u0443\u0437\u043E\u0447\u043D\u043E-\u0440\u0430\u0437\u0433\u0440\u0443\u0437\u043E\u0447\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42418910-1: "\u0417\u0430\u0433\u0440\u0443\u0437\u043E\u0447\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42418920-4: "\u0420\u0430\u0437\u0433\u0440\u0443\u0437\u043E\u0447\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42418930-7: "\u041F\u043E\u0433\u0440\u0443\u0437\u0447\u0438\u043A\u0438 \u0441 \u0431\u043E\u043A\u043E\u0432\u044B\u043C \u0432\u044B\u0434\u0432\u0438\u0436\u043D\u044B\u043C \u0433\u0440\u0443\u0437\u043E\u043F\u043E\u0434\u044A\u0451\u043C\u043D\u0438\u043A\u043E\u043C"
42418940-0: "\u041E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0434\u043B\u044F \u043F\u0435\u0440\u0435\u043C\u0435\u0449\u0435\u043D\u0438\u044F \u043A\u043E\u043D\u0442\u0435\u0439\u043D\u0435\u0440\u043E\u0432"
42419000-6: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043F\u043E\u0434\u044A\u0435\u043C\u043D\u043E-\u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u043E\u0433\u043E \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F"
42419100-7: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043A\u0440\u0430\u043D\u043E\u0432"
42419200-8: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0433\u0440\u0443\u0437\u043E\u0432\u044B\u0445 \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0438\u043B\u0435\u0439 \u0441 \u043C\u0430\u043D\u0438\u043F\u0443\u043B\u044F\u0442\u043E\u0440\u0430\u043C\u0438"
42419500-1: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u043B\u0438\u0444\u0442\u043E\u0432, \u0441\u043A\u0438\u043F\u043E\u0432\u044B\u0445 \u043F\u043E\u0434\u044A\u0435\u043C\u043D\u0438\u043A\u043E\u0432 \u0438\u043B\u0438 \u044D\u0441\u043A\u0430\u043B\u0430\u0442\u043E\u0440\u043E\u0432"
42419510-4: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043B\u0438\u0444\u0442\u043E\u0432"
42419520-7: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0441\u043A\u0438\u043F\u043E\u0432\u044B\u0445 \u043F\u043E\u0434\u044A\u0435\u043C\u043D\u0438\u043A\u043E\u0432"
42419530-0: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u044D\u0441\u043A\u0430\u043B\u0430\u0442\u043E\u0440\u043E\u0432"
42419540-3: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0434\u0432\u0438\u0436\u0443\u0449\u0438\u0445\u0441\u044F \u0434\u043E\u0440\u043E\u0436\u0435\u043A"
42419800-4: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043A\u043E\u043D\u0432\u0435\u0439\u0435\u0440\u043E\u0432"
42419810-7: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043B\u0435\u043D\u0442\u043E\u0447\u043D\u044B\u0445 \u043A\u043E\u043D\u0432\u0435\u0439\u0435\u0440\u043E\u0432"
42419890-1: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0448\u043D\u0435\u043A\u043E\u0432\u044B\u0445 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0435\u0440\u043E\u0432"
42419900-5: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0433\u043E\u0440\u043D\u043E\u0434\u043E\u0431\u044B\u0432\u0430\u044E\u0449\u0438\u0445 \u043C\u0430\u0448\u0438\u043D \u0438 \u0434\u0440\u0443\u0433\u043E\u0433\u043E \u043F\u043E\u0434\u044A\u0435\u043C\u043D\u043E\u0433\u043E \u0438\u043B\u0438 \u043F\u043E\u0433\u0440\u0443\u0437\u043E\u0447\u043D\u043E\u0433\u043E \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F"
42420000-6: "\u041A\u043E\u0432\u0448\u0438, \u043B\u043E\u043F\u0430\u0442\u044B, \u0433\u0440\u0435\u0439\u0444\u0435\u0440\u044B, \u0437\u0430\u0445\u0432\u0430\u0442\u044B \u0438 \u0437\u0430\u0445\u0432\u0430\u0442\u044B \u0434\u043B\u044F \u043A\u0440\u0430\u043D\u043E\u0432 \u0438 \u044D\u043A\u0441\u043A\u0430\u0432\u0430\u0442\u043E\u0440\u043E\u0432"
42500000-1: "\u041E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0434\u043B\u044F \u043E\u0445\u043B\u0430\u0436\u0434\u0435\u043D\u0438\u044F \u0438 \u0432\u0435\u043D\u0442\u0438\u043B\u044F\u0446\u0438\u0438"
42510000-4: "\u0422\u0435\u043F\u043B\u043E\u043E\u0431\u043C\u0435\u043D\u043D\u0438\u043A\u0438, \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0434\u043B\u044F \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F,  \u0445\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0438 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430 \u0444\u0438\u043B\u044C\u0442\u0440\u0430\u0446\u0438\u0438"
42511000-1: "\u0422\u0435\u043F\u043B\u043E\u043E\u0431\u043C\u0435\u043D\u043D\u0438\u043A\u0438 \u0438 \u043C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u0441\u0436\u0438\u0436\u0435\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430 \u0438\u043B\u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u0433\u0430\u0437\u043E\u0432"
42511100-2: "\u0422\u0435\u043F\u043B\u043E\u043E\u0431\u043C\u0435\u043D\u043D\u0438\u043A\u0438"
42511110-5: "\u0422\u0435\u043F\u043B\u043E\u0432\u044B\u0435 \u043D\u0430\u0441\u043E\u0441\u044B"
42511200-3: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u0441\u0436\u0438\u0436\u0435\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430 \u0438\u043B\u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u0433\u0430\u0437\u043E\u0432"
42512000-8: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u0434\u043B\u044F \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430"
42512100-9: "\u041E\u043A\u043E\u043D\u043D\u044B\u0435 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430 \u0434\u043B\u044F \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430"
42512200-0: "\u041D\u0430\u0441\u0442\u0435\u043D\u043D\u044B\u0435 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430  \u0434\u043B\u044F \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430"
42512300-1: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u0434\u043B\u044F \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F"
42512400-2: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u0434\u043B\u044F \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430 \u0432 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u044B\u0445 \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0430\u0445"
42512500-3: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u043A \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430\u043C \u0434\u043B\u044F \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430"
42512510-6: "\u0420\u0435\u0433\u0438\u0441\u0442\u0440\u044B"
42512520-9: "\u0412\u0435\u043D\u0442\u0438\u043B\u044F\u0446\u0438\u043E\u043D\u043D\u044B\u0435 \u043A\u0430\u043D\u0430\u043B\u044B"
42513000-5: "\u0425\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u043E\u0435 \u0438 \u043C\u043E\u0440\u043E\u0437\u0438\u043B\u044C\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42513100-6: "\u041C\u043E\u0440\u043E\u0437\u0438\u043B\u044C\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42513200-7: "\u0425\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42513210-0: "\u0425\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u044B\u0435 \u0432\u0438\u0442\u0440\u0438\u043D\u044B"
42513220-3: "\u0425\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u044B\u0435 \u043F\u0440\u0438\u043B\u0430\u0432\u043A\u0438"
42513290-4: "\u041F\u0440\u043E\u043C\u044B\u0448\u043B\u0435\u043D\u043D\u043E\u0435 \u0445\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42514000-2: "\u041F\u0440\u0438\u0431\u043E\u0440\u044B \u0438 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430 \u0434\u043B\u044F \u0444\u0438\u043B\u044C\u0442\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0438\u043B\u0438 \u043E\u0447\u0438\u0441\u0442\u043A\u0438 \u0433\u0430\u0437\u043E\u0432"
42514200-4: "\u042D\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043E\u0447\u0438\u0441\u0442\u0438\u0442\u0435\u043B\u0438 \u0432\u043E\u0437\u0434\u0443\u0445\u0430 \u0438 \u0433\u0430\u0437\u0430"
42514300-5: "\u0424\u0438\u043B\u044C\u0442\u0440\u0443\u044E\u0449\u0438\u0435 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430"
