42522100-2: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0432\u0435\u043D\u0442\u0438\u043B\u044F\u0442\u043E\u0440\u043E\u0432"
42530000-0: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u0445\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u043E\u0433\u043E \u0438 \u043C\u043E\u0440\u043E\u0437\u0438\u043B\u044C\u043D\u043E\u0433\u043E \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0438 \u0442\u0435\u043F\u043B\u043E\u0432\u044B\u0445 \u043D\u0430\u0441\u043E\u0441\u043E\u0432"
