42600000-2: "\u041C\u0435\u0445\u0430\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0441\u0442\u0430\u043D\u043A\u0438"
42610000-5: "\u041C\u0435\u0445\u0430\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0441\u0442\u0430\u043D\u043A\u0438, \u0443\u043F\u0440\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u0441 \u043F\u043E\u043C\u043E\u0449\u044C\u044E \u043B\u0430\u0437\u0435\u0440\u0430, \u0438 \u043E\u0431\u0440\u0430\u0431\u0430\u0442\u044B\u0432\u0430\u044E\u0449\u0438\u0435 \u0446\u0435\u043D\u0442\u0440\u044B"
42611000-2: "\u041C\u0435\u0445\u0430\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0441\u0442\u0430\u043D\u043A\u0438 \u0441\u043F\u0435\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043D\u0430\u0437\u043D\u0430\u0447\u0435\u043D\u0438\u044F"
42612000-9: "\u041E\u0431\u0440\u0430\u0431\u0430\u0442\u044B\u0432\u0430\u044E\u0449\u0438\u0435 \u0446\u0435\u043D\u0442\u0440\u044B"
42612100-0: "\u041E\u0431\u0440\u0430\u0431\u0430\u0442\u044B\u0432\u0430\u044E\u0449\u0438\u0435 \u0446\u0435\u043D\u0442\u0440\u044B \u0441 \u0433\u043E\u0440\u0438\u0437\u043E\u043D\u0442\u0430\u043B\u044C\u043D\u043E\u0439 \u043E\u0441\u044C\u044E"
42612200-1: "\u041E\u0431\u0440\u0430\u0431\u0430\u0442\u044B\u0432\u0430\u044E\u0449\u0438\u0435 \u0446\u0435\u043D\u0442\u0440\u044B \u0441 \u0432\u0435\u0440\u0442\u0438\u043A\u0430\u043B\u044C\u043D\u043E\u0439 \u043E\u0441\u044C\u044E"
42620000-8: "\u0422\u043E\u043A\u0430\u0440\u043D\u044B\u0435 \u0441\u0442\u0430\u043D\u043A\u0438, \u0440\u0430\u0441\u0442\u043E\u0447\u043D\u044B\u0435 \u0438 \u0444\u0440\u0435\u0437\u0435\u0440\u043D\u044B\u0435 \u0441\u0442\u0430\u043D\u043A\u0438"
