42636000-3: "\u041F\u0440\u0435\u0441\u0441\u044B"
42636100-4: "\u0413\u0438\u0434\u0440\u0430\u0432\u043B\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043F\u0440\u0435\u0441\u0441\u044B"
42637000-0: "\u041C\u0435\u0445\u0430\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0441\u0442\u0430\u043D\u043A\u0438 \u0434\u043B\u044F \u0441\u0432\u0435\u0440\u043B\u0435\u043D\u0438\u044F, \u0440\u0430\u0441\u0441\u0432\u0435\u0440\u043B\u0438\u0432\u0430\u043D\u0438\u044F \u0438\u043B\u0438 \u0444\u0440\u0435\u0437\u0435\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u043C\u0435\u0442\u0430\u043B\u043B\u0430"
42637100-1: "\u041C\u0435\u0445\u0430\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0441\u0442\u0430\u043D\u043A\u0438 \u0434\u043B\u044F \u0441\u0432\u0435\u0440\u043B\u0435\u043D\u0438\u044F \u043C\u0435\u0442\u0430\u043B\u043B\u0430"
