42912310-8: "\u0410\u043F\u043F\u0430\u0440\u0430\u0442\u044B \u0434\u043B\u044F \u0444\u0438\u043B\u044C\u0442\u0440\u0430\u0446\u0438\u0438 \u0432\u043E\u0434\u044B"
42912320-1: "\u0410\u043F\u043F\u0430\u0440\u0430\u0442\u044B \u0434\u043B\u044F \u0434\u0435\u0430\u044D\u0440\u0430\u0446\u0438\u0438"
42912330-4: "\u0410\u043F\u043F\u0430\u0440\u0430\u0442\u044B \u0434\u043B\u044F \u043E\u0447\u0438\u0441\u0442\u043A\u0438 \u0432\u043E\u0434\u044B"
42912340-7: "\u041E\u043F\u0440\u0435\u0441\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0430\u043F\u043F\u0430\u0440\u0430\u0442\u044B"
42912350-0: "\u041E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0434\u043B\u044F \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u0444\u0438\u043B\u044C\u0442\u0440\u043E\u0432"
42913000-9: "\u041C\u0430\u0441\u043B\u044F\u043D\u044B\u0435 \u0444\u0438\u043B\u044C\u0442\u0440\u044B, \u0442\u043E\u043F\u043B\u0438\u0432\u043D\u044B\u0435 \u0444\u0438\u043B\u044C\u0442\u0440\u044B \u0438 \u0432\u043E\u0437\u0434\u0443\u0445\u043E\u0437\u0430\u0431\u043E\u0440\u043D\u044B\u0435 \u0444\u0438\u043B\u044C\u0442\u0440\u044B"
42913300-2: "\u041C\u0430\u0441\u043B\u044F\u043D\u044B\u0435 \u0444\u0438\u043B\u044C\u0442\u0440\u044B"
42913400-3: "\u0422\u043E\u043F\u043B\u0438\u0432\u043D\u044B\u0435 \u0444\u0438\u043B\u044C\u0442\u0440\u044B"
42913500-4: "\u0412\u043E\u0437\u0434\u0443\u0445\u043E\u0437\u0430\u0431\u043E\u0440\u043D\u044B\u0435 \u0444\u0438\u043B\u044C\u0442\u0440\u044B"
42914000-6: "\u041E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u043F\u0435\u0440\u0435\u0440\u0430\u0431\u043E\u0442\u043A\u0438"
42920000-1: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u043C\u044B\u0442\u044C\u044F \u0431\u0443\u0442\u044B\u043B\u043E\u043A, \u0443\u043F\u0430\u043A\u043E\u0432\u043A\u0438, \u0432\u0437\u0432\u0435\u0448\u0438\u0432\u0430\u043D\u0438\u044F \u0438 \u0440\u0430\u0441\u043F\u044B\u043B\u0435\u043D\u0438\u044F"
42921000-8: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u043E\u0447\u0438\u0441\u0442\u043A\u0438, \u0444\u0430\u0441\u043E\u0432\u043A\u0438, \u0443\u043F\u0430\u043A\u043E\u0432\u043A\u0438 \u0438\u043B\u0438 \u0444\u0430\u0441\u043E\u0432\u043A\u0438 \u0431\u0443\u0442\u044B\u043B\u043E\u043A \u0438\u043B\u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u0435\u043C\u043A\u043E\u0441\u0442\u0435\u0439"
42921100-9: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u043C\u043E\u0439\u043A\u0438 \u0438\u043B\u0438 \u0441\u0443\u0448\u043A\u0438 \u0431\u0443\u0442\u044B\u043B\u043E\u043A \u0438\u043B\u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u0435\u043C\u043A\u043E\u0441\u0442\u0435\u0439"
42921200-0: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u0437\u0430\u043F\u043E\u043B\u043D\u0435\u043D\u0438\u044F  \u0438 \u0433\u0435\u0440\u043C\u0435\u0442\u0438\u0437\u0430\u0446\u0438\u0438 \u0431\u0443\u0442\u044B\u043B\u043E\u043A, \u0431\u0430\u043D\u043E\u043A \u0438\u043B\u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u0435\u043C\u043A\u043E\u0441\u0442\u0435\u0439"
42921300-1: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u0443\u043F\u0430\u043A\u043E\u0432\u043A\u0438 \u0438\u043B\u0438 \u0444\u0430\u0441\u043E\u0432\u043A\u0438"
42921310-4: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u0441\u043E\u0435\u0434\u0438\u043D\u0435\u043D\u0438\u044F \u0443\u043F\u0430\u043A\u043E\u0432\u043E\u043A"
42921320-7: "\u0423\u043F\u0430\u043A\u043E\u0432\u043E\u0447\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42921330-0: "\u0424\u0430\u0441\u043E\u0432\u043E\u0447\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42923000-2: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u0432\u0437\u0432\u0435\u0448\u0438\u0432\u0430\u043D\u0438\u044F \u0438 \u0432\u0435\u0441\u044B"
42923100-3: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u0432\u0437\u0432\u0435\u0448\u0438\u0432\u0430\u043D\u0438\u044F"
42923110-6: "\u0413\u0438\u0440\u0435\u0432\u044B\u0435 \u0432\u0435\u0441\u044B"
42923200-4: "\u0412\u0435\u0441\u044B"
42923210-7: "\u041C\u0430\u0433\u0430\u0437\u0438\u043D\u043D\u044B\u0435 \u0432\u0435\u0441\u044B"
42923220-0: "\u0423\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430 \u0434\u043B\u044F \u043D\u0435\u043F\u0440\u0435\u0440\u044B\u0432\u043D\u043E\u0433\u043E \u0432\u0437\u0432\u0435\u0448\u0438\u0432\u0430\u043D\u0438\u044F \u0442\u043E\u0432\u0430\u0440\u043E\u0432"
42923230-3: "\u041A\u043E\u043D\u0442\u0440\u043E\u043B\u044C\u043D\u044B\u0435 \u0432\u0435\u0441\u044B"
42924200-1: "\u041C\u0430\u0448\u0438\u043D\u044B \u043F\u0430\u0440\u043E\u0441\u0442\u0440\u0443\u0439\u043D\u044B\u0435 \u0438\u043B\u0438 \u043F\u0435\u0441\u043A\u043E\u0441\u0442\u0440\u0443\u0439\u043D\u044B\u0435"
42924300-2: "\u0420\u0430\u0441\u043F\u044B\u043B\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435"
42924310-5: "\u041F\u0438\u0441\u0442\u043E\u043B\u0435\u0442\u044B \u0434\u043B\u044F \u043E\u043F\u0440\u044B\u0441\u043A\u0438\u0432\u0430\u043D\u0438\u044F"
42924700-6: "\u041C\u0435\u0445\u0430\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430 \u0434\u043B\u044F \u043C\u0435\u0442\u0430\u043D\u0438\u044F, \u0440\u0430\u0437\u0431\u0440\u044B\u0437\u0433\u0438\u0432\u0430\u043D\u0438\u044F \u0438\u043B\u0438 \u0440\u0430\u0441\u043F\u044B\u043B\u0435\u043D\u0438\u044F"
42924710-9: "\u0423\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430 \u0434\u043B\u044F \u0434\u0438\u0441\u043F\u0435\u0440\u0433\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0433\u0430\u0437\u043E\u0432"
42924720-2: "\u041E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0434\u043B\u044F \u0434\u0435\u0437\u0430\u043A\u0442\u0438\u0432\u0430\u0446\u0438\u0438"
42924730-5: "\u041E\u0447\u0438\u0441\u0442\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430 \u0441 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u0435\u043C \u0432\u043E\u0434\u044B \u043F\u043E\u0434 \u0434\u0430\u0432\u043B\u0435\u043D\u0438\u0435\u043C"
42924740-8: "\u0410\u043F\u043F\u0430\u0440\u0430\u0442\u044B \u043E\u0447\u0438\u0441\u0442\u043A\u0438 \u0432\u044B\u0441\u043E\u043A\u043E\u0433\u043E \u0434\u0430\u0432\u043B\u0435\u043D\u0438\u044F"
42924790-3: "\u0414\u0435\u0437\u043E\u0434\u043E\u0440\u0438\u0440\u0443\u044E\u0449\u0438\u0435 \u0430\u043F\u043F\u0430\u0440\u0430\u0442\u044B"
42930000-4: "\u0426\u0435\u043D\u0442\u0440\u0438\u0444\u0443\u0433\u0438, \u043C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u043A\u0430\u043B\u0430\u043D\u0434\u0440\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0438\u043B\u0438 \u0442\u043E\u0440\u0433\u043E\u0432\u044B\u0435 \u0430\u0432\u0442\u043E\u043C\u0430\u0442\u044B"
42931000-1: "\u0426\u0435\u043D\u0442\u0440\u0438\u0444\u0443\u0433\u0438"
42931100-2: "\u041B\u0430\u0431\u043E\u0440\u0430\u0442\u043E\u0440\u043D\u044B\u0435 \u0446\u0435\u043D\u0442\u0440\u0438\u0444\u0443\u0433\u0438  \u0438 \u0430\u043A\u0441\u0435\u0441\u0441\u0443\u0430\u0440\u044B"
42931110-5: "\u0426\u0435\u043D\u0442\u0440\u0438\u0444\u0443\u0433\u0438, \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043B\u0435\u043D\u043D\u044B\u0435 \u043D\u0430 \u043F\u043E\u043B\u0443"
42931120-8: "\u041D\u0430\u0441\u0442\u043E\u043B\u044C\u043D\u044B\u0435 \u0446\u0435\u043D\u0442\u0440\u0438\u0444\u0443\u0433\u0438"
42931130-1: "\u0420\u0435\u0434\u0443\u043A\u0442\u043E\u0440\u044B \u0434\u043B\u044F  \u0446\u0435\u043D\u0442\u0440\u0438\u0444\u0443\u0433"
42931140-4: "\u0412\u0440\u0430\u0449\u0430\u044E\u0449\u0435\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0434\u043B\u044F \u0446\u0435\u043D\u0442\u0440\u0438\u0444\u0443\u0433"
42932000-8: "\u041C\u0430\u0448\u0438\u043D\u044B  \u0434\u043B\u044F \u043A\u0430\u043B\u0430\u043D\u0434\u0440\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F"
42932100-9: "\u041C\u0430\u0448\u0438\u043D\u044B \u0434\u043B\u044F \u043B\u0430\u043C\u0438\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F"
42933000-5: "\u0410\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0434\u0438\u0441\u043F\u0435\u043D\u0441\u0435\u0440\u044B"
42933100-6: "\u0410\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0434\u0438\u0441\u043F\u0435\u043D\u0441\u0435\u0440\u044B \u0434\u043B\u044F \u0433\u0438\u0433\u0438\u0435\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0438\u0437\u0434\u0435\u043B\u0438\u0439"
42933200-7: "\u0410\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0434\u0438\u0441\u043F\u0435\u043D\u0441\u0435\u0440\u044B \u0434\u043B\u044F \u043C\u0430\u0440\u043E\u043A"
42933300-8: "\u0410\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0434\u0438\u0441\u043F\u0435\u043D\u0441\u0435\u0440\u044B \u0434\u043B\u044F \u0442\u043E\u0432\u0430\u0440\u043E\u0432 (\u0442\u043E\u0440\u0433\u043E\u0432\u044B\u0435 \u0430\u0432\u0442\u043E\u043C\u0430\u0442\u044B)"
42940000-7: "\u041E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0434\u043B\u044F \u0442\u0435\u0440\u043C\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u043E\u0431\u0440\u0430\u0431\u043E\u0442\u043A\u0438 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u043E\u0432"
42941000-4: "\u041E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0434\u043B\u044F \u0442\u0435\u0440\u043C\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u043E\u0431\u0440\u0430\u0431\u043E\u0442\u043A\u0438 \u0433\u0430\u0437\u043E\u0432"
42942000-1: "\u041F\u0435\u0447\u0438 \u0438 \u0430\u043A\u0441\u0435\u0441\u0441\u0443\u0430\u0440\u044B"
42942200-3: "\u0412\u0430\u043A\u0443\u0443\u043C\u043D\u044B\u0435 \u043F\u0435\u0447\u0438"
42943000-8: "\u0422\u0435\u0440\u043C\u043E\u0441\u0442\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0431\u0430\u043D\u0438 \u0438 \u0430\u043A\u0441\u0435\u0441\u0441\u0443\u0430\u0440\u044B"
42943100-9: "\u0417\u043C\u0435\u0435\u043E\u0431\u0440\u0430\u0437\u043D\u044B\u0435 \u043E\u0445\u043B\u0430\u0434\u0438\u0442\u0435\u043B\u0438 (\u0437\u043C\u0435\u0435\u0432\u0438\u043A\u0438)"
42943200-0: "\u0423\u043B\u044C\u0442\u0440\u0430\u0437\u0432\u0443\u043A\u043E\u0432\u044B\u0435 \u0432\u0430\u043D\u043D\u044B"
42943210-3: "\u041F\u043E\u0433\u0440\u0443\u0436\u043D\u044B\u0435 \u0442\u0435\u0440\u043C\u043E\u0441\u0442\u0430\u0442\u044B"
42943300-1: "\u041F\u043E\u0433\u0440\u0443\u0436\u043D\u044B\u0435 \u043E\u0445\u043B\u0430\u0434\u0438\u0442\u0435\u043B\u0438"
42943400-2: "\u0426\u0438\u0440\u043A\u0443\u043B\u044F\u0442\u043E\u0440\u044B \u0434\u043B\u044F \u043E\u0445\u043B\u0430\u0436\u0434\u0435\u043D\u0438\u044F \u0438 \u0446\u0438\u0440\u043A\u0443\u043B\u044F\u0442\u043E\u0440\u044B \u0434\u043B\u044F \u043E\u0445\u043B\u0430\u0436\u0434\u0435\u043D\u0438\u044F / \u043E\u0431\u043E\u0433\u0440\u0435\u0432\u0430"
42943500-3: "\u0420\u0435\u0446\u0438\u0440\u043A\u0443\u043B\u044F\u0446\u0438\u043E\u043D\u043D\u044B\u0435 \u043E\u0445\u043B\u0430\u0434\u0438\u0442\u0435\u043B\u0438"
42943600-4: "\u0412\u044B\u0441\u043E\u043A\u043E\u0442\u0435\u043C\u043F\u0435\u0440\u0430\u0442\u0443\u0440\u043D\u044B\u0435 \u0446\u0438\u0440\u043A\u0443\u043B\u044F\u0442\u043E\u0440\u044B"
42943700-5: "\u0426\u0438\u0440\u043A\u0443\u043B\u044F\u0442\u043E\u0440\u044B \u0441 \u043D\u0430\u0433\u0440\u0435\u0432\u043E\u043C"
42943710-8: "\u041A\u0443\u043F\u0430\u043B\u044C\u043D\u044B\u0435 \u0448\u0430\u043F\u043E\u0447\u043A\u0438"
42950000-0: "\u0417\u0430\u043F\u0430\u0441\u043D\u044B\u0435 \u0447\u0430\u0441\u0442\u0438 \u0434\u043B\u044F \u043C\u0430\u0448\u0438\u043D \u043E\u0431\u0449\u0435\u0433\u043E \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u044F"
