45112450-4: "\u0417\u0435\u043C\u043B\u044F\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043D\u0430 \u0430\u0440\u0445\u0435\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043F\u043B\u043E\u0449\u0430\u0434\u043A\u0430\u0445"
45112500-0: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043F\u0435\u0440\u0435\u043C\u0435\u0449\u0435\u043D\u0438\u044E \u0437\u0435\u043C\u043B\u0438"
45112600-1: "\u0412\u044B\u0435\u043C\u043A\u0430 \u0441 \u0437\u0430\u043A\u043B\u0430\u0434\u043A\u043E\u0439"
45112700-2: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45112710-5: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u0432 \u0437\u0435\u043B\u0435\u043D\u044B\u0445 \u0437\u043E\u043D\u0430\u0445"
45112711-2: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u0432 \u043F\u0430\u0440\u043A\u0430\u0445"
45112712-9: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u0432 \u0441\u0430\u0434\u0430\u0445"
45112713-6: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u0432 \u0441\u0430\u0434\u0430\u0445 \u043D\u0430 \u043A\u0440\u044B\u0448\u0430\u0445"
45112714-3: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043A\u0430 \u043A\u043B\u0430\u0434\u0431\u0438\u0449\u0430\u0445"
45112720-8: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043D\u0430 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u044B\u0445 \u043F\u043B\u043E\u0449\u0430\u0434\u043A\u0430\u0445 \u0438 \u0432 \u0437\u043E\u043D\u0430\u0445 \u043E\u0442\u0434\u044B\u0445\u0430"
45112721-5: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043D\u0430 \u043F\u043E\u043B\u044F\u0445 \u0434\u043B\u044F \u0433\u043E\u043B\u044C\u0444\u0430"
45112722-2: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043D\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043E\u0440\u0438\u044F\u0445 \u0434\u043B\u044F \u0432\u0435\u0440\u0445\u043E\u0432\u043E\u0439 \u0435\u0437\u0434\u044B"
45112723-9: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043D\u0430 \u0438\u0433\u0440\u043E\u0432\u044B\u0445 \u043F\u043B\u043E\u0449\u0430\u0434\u043A\u0430\u0445"
45112730-1: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043D\u0430 \u0434\u043E\u0440\u043E\u0433\u0430\u0445 \u0438 \u0448\u043E\u0441\u0441\u0435"
45112740-4: "\u041B\u0430\u043D\u0434\u0448\u0430\u0444\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u0432 \u0430\u044D\u0440\u043E\u043F\u043E\u0440\u0442\u0430\u0445"
45113000-2: "\u0420\u0430\u0431\u043E\u0442\u044B \u043D\u0430 \u0440\u0430\u0431\u043E\u0447\u0435\u0439 \u043F\u043B\u043E\u0449\u0430\u0434\u043A\u0435"
45120000-4: "\u0420\u0430\u0437\u0432\u0435\u0434\u044B\u0432\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0438 \u0431\u0443\u0440\u043E\u0432\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45121000-1: "\u042D\u043A\u0441\u043F\u0435\u0440\u0438\u043C\u0435\u043D\u0442\u0430\u043B\u044C\u043D\u044B\u0435 \u0431\u0443\u0440\u043E\u0432\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45122000-8: "\u0418\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u0441\u043A\u0438\u0435 \u0431\u0443\u0440\u043E\u0432\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45200000-9: "\u041F\u043E\u043B\u043D\u044B\u0435 \u0438\u043B\u0438 \u0447\u0430\u0441\u0442\u0438\u0447\u043D\u044B\u0435 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u0438 \u043F\u0443\u0431\u043B\u0438\u0447\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45210000-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0438 \u0441\u043E\u043E\u0440\u0443\u0436\u0435\u043D\u0438\u0439"
45211000-9: "\u041A\u043E\u043B\u043B\u0435\u043A\u0442\u0438\u0432\u043D\u043E\u0435 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0438 \u0438\u043D\u0434\u0438\u0432\u0438\u0434\u0443\u0430\u043B\u044C\u043D\u044B\u0445 \u0434\u043E\u043C\u043E\u0432"
45211100-0: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0443 \u0434\u043E\u043C\u043E\u0432"
45211200-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0436\u0438\u043B\u044C\u044F"
45211300-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0434\u043E\u043C\u043E\u0432"
45211310-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0431\u0430\u043D\u044C"
45211320-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u0435\u0440\u0430\u043D\u0434"
45211340-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043E\u043B\u043B\u0435\u043A\u0442\u0438\u0432\u043D\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439"
45211341-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u0432\u0430\u0440\u0442\u0438\u0440"
45211350-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043C\u043D\u043E\u0433\u043E\u0444\u0443\u043D\u043A\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439"
45211360-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044E \u0433\u043E\u0440\u043E\u0434\u0430"
45211370-3: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0443 \u0441\u0430\u0443\u043D"
45212000-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u043F\u0440\u043E\u0432\u0435\u0434\u0435\u043D\u0438\u044F \u0434\u043E\u0441\u0443\u0433\u0430, \u0434\u043B\u044F \u0437\u0430\u043D\u044F\u0442\u0438\u0439 \u0441\u043F\u043E\u0440\u0442\u043E\u043C, \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u043D\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439, \u0433\u043E\u0441\u0442\u0438\u043D\u0438\u0446 \u0438 \u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u043E\u0432"
45212100-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043E\u0432 \u0434\u043B\u044F \u0441\u0432\u043E\u0431\u043E\u0434\u043D\u043E\u0433\u043E \u0432\u0440\u0435\u043C\u044F\u043F\u0440\u0435\u043F\u0440\u043E\u0432\u043E\u0436\u0434\u0435\u043D\u0438\u044F"
45212110-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0446\u0435\u043D\u0442\u0440\u043E\u0432 \u0434\u043B\u044F \u0441\u0432\u043E\u0431\u043E\u0434\u043D\u043E\u0433\u043E \u0432\u0440\u0435\u043C\u044F\u043F\u0440\u0435\u043F\u0440\u043E\u0432\u043E\u0436\u0434\u0435\u043D\u0438\u044F"
45212120-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0435\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043F\u0430\u0440\u043A\u043E\u0432"
45212130-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u0430\u0440\u043A\u043E\u0432 \u0440\u0430\u0437\u0432\u043B\u0435\u0447\u0435\u043D\u0438\u044F"
45212140-9: "\u0411\u0430\u0437\u044B \u043E\u0442\u0434\u044B\u0445\u0430"
45212150-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u0438\u043D\u043E\u0442\u0435\u0430\u0442\u0440\u043E\u0432"
45212160-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u0430\u0437\u0438\u043D\u043E"
45212170-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0440\u0430\u0437\u0432\u043B\u0435\u043A\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439"
45212171-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0440\u0430\u0437\u0432\u043B\u0435\u043A\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0445 \u0446\u0435\u043D\u0442\u0440\u043E\u0432"
45212172-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0446\u0435\u043D\u0442\u0440\u043E\u0432 \u043E\u0442\u0434\u044B\u0445\u0430"
45212180-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0431\u0438\u043B\u0435\u0442\u043D\u044B\u0445 \u043A\u0430\u0441\u0441"
45212190-4: "\u0417\u0430\u0449\u0438\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043E\u0442 \u0441\u043E\u043B\u043D\u0435\u0447\u043D\u044B\u0445 \u043B\u0443\u0447\u0435\u0439"
45212200-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u044B\u0445 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043E\u0432"
45212210-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u043F\u0435\u0446\u0438\u0430\u043B\u0438\u0437\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u044B\u0445 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u044B\u0445 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043E\u0432"
45212211-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043B\u0435\u0434\u043E\u0432\u044B\u0445 \u043A\u0430\u0442\u043A\u043E\u0432"
45212212-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0431\u0430\u0441\u0441\u0435\u0439\u043D\u043E\u0432"
45212213-2: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043D\u0430\u043D\u0435\u0441\u0435\u043D\u0438\u044E \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u043E\u0439 \u0440\u0430\u0437\u043C\u0435\u0442\u043A\u0438"
45212220-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043C\u043D\u043E\u0433\u043E\u0444\u0443\u043D\u043A\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u044B\u0445 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043E\u0432"
45212221-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u0439 \u0434\u043B\u044F \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u044B\u0445 \u043F\u043B\u043E\u0449\u0430\u0434\u043E\u043A"
45212222-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0433\u0438\u043C\u043D\u0430\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0437\u0430\u043B\u043E\u0432"
45212223-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0438\u043C\u043D\u0438\u0445 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u044B\u0445 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043E\u0432"
45212224-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u0442\u0430\u0434\u0438\u043E\u043D\u043E\u0432"
45212225-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0434\u0432\u043E\u0440\u0446\u043E\u0432 \u0441\u043F\u043E\u0440\u0442\u0430"
45212230-7: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0448\u043A\u0430\u0444\u0447\u0438\u043A\u043E\u0432 \u0432 \u0440\u0430\u0437\u0434\u0435\u0432\u0430\u043B\u043A\u0430\u0445"
45212290-5: "\u0420\u0435\u043C\u043E\u043D\u0442 \u0438 \u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u043E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u0435 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u044B\u0445 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043E\u0432"
45212300-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439, \u043F\u0440\u0435\u0434\u043D\u0430\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044B\u0445 \u0434\u043B\u044F \u0438\u0441\u043A\u0443\u0441\u0441\u0442\u0432\u0430 \u0438 \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u043D\u044B\u0445 \u043C\u0435\u0440\u043E\u043F\u0440\u0438\u044F\u0442\u0438\u0439"
45212310-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u044B\u0441\u0442\u0430\u0432\u043E\u0447\u043D\u044B\u0445 \u0446\u0435\u043D\u0442\u0440\u043E\u0432"
45212311-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0445\u0443\u0434\u043E\u0436\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0445 \u0433\u0430\u043B\u0435\u0440\u0435\u0439"
45212312-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u044B\u0441\u0442\u0430\u0432\u043E\u0447\u043D\u044B\u0445 \u0446\u0435\u043D\u0442\u0440\u043E\u0432"
45212313-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043C\u0443\u0437\u0435\u0435\u0432"
45212314-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0438\u0441\u0442\u043E\u0440\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043F\u0430\u043C\u044F\u0442\u043D\u0438\u043A\u043E\u0432 \u0438 \u043C\u0435\u043C\u043E\u0440\u0438\u0430\u043B\u043E\u0432"
45212320-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u0430\u0440\u0442\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u0434\u0435\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u0438"
45212321-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u0443\u0434\u0438\u0442\u043E\u0440\u0438\u0439"
45212322-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0435\u0430\u0442\u0440\u043E\u0432"
45212330-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0431\u0438\u0431\u043B\u0438\u043E\u0442\u0435\u043A"
45212331-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043C\u0443\u043B\u044C\u0442\u0438\u043C\u0435\u0434\u0438\u0439\u043D\u044B\u0445 \u0431\u0438\u0431\u043B\u0438\u043E\u0442\u0435\u043A"
45212340-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043E\u043D\u0444\u0435\u0440\u0435\u043D\u0446-\u0437\u0430\u043B\u043E\u0432"
45212350-4: "\u0417\u0434\u0430\u043D\u0438\u044F, \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043B\u044F\u044E\u0449\u0438\u0435 \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u044B\u0439 \u0438\u0441\u0442\u043E\u0440\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u0438\u043B\u0438 \u0430\u0440\u0445\u0438\u0442\u0435\u043A\u0442\u0443\u0440\u043D\u043E\u0439 \u0438\u043D\u0442\u0435\u0440\u0435\u0441"
45212351-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0434\u043E\u0438\u0441\u0442\u043E\u0440\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043F\u0430\u043C\u044F\u0442\u043D\u0438\u043A\u043E\u0432"
45212352-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u0440\u043E\u043C\u044B\u0448\u043B\u0435\u043D\u043D\u044B\u0445 \u043F\u0430\u043C\u044F\u0442\u043D\u0438\u043A\u043E\u0432"
45212353-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0434\u0432\u043E\u0440\u0446\u043E\u0432"
45212354-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0430\u043C\u043A\u043E\u0432"
45212360-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0440\u0435\u043B\u0438\u0433\u0438\u043E\u0437\u043D\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439"
45212361-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0446\u0435\u0440\u043A\u0432\u0435\u0439"
45212400-0: "\u0413\u043E\u0441\u0442\u0438\u043D\u0438\u0446\u044B \u0438 \u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u044B"
45212410-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0436\u0438\u043B\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439"
45212411-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0433\u043E\u0441\u0442\u0438\u043D\u0438\u0446"
45212412-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043E\u0431\u0449\u0435\u0436\u0438\u0442\u0438\u0439, \u043F\u0430\u043D\u0441\u0438\u043E\u043D\u043E\u0432"
45212413-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u043A\u0440\u0430\u0442\u043A\u043E\u0441\u0440\u043E\u0447\u043D\u043E\u0433\u043E \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u043D\u0438\u044F"
45212420-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u043E\u0432 \u0438 \u043F\u043E\u0434\u043E\u0431\u043D\u044B\u0445 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043E\u0432"
45212421-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u043E\u0432"
45212422-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u0442\u043E\u043B\u043E\u0432\u044B\u0445"
45212423-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u0430\u0444\u0435"
45212500-1: "\u041F\u0435\u0440\u0435\u0441\u0442\u0440\u043E\u0439\u043A\u0430 \u043A\u0443\u0445\u043E\u043D\u044C \u0438\u043B\u0438 \u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u043E\u0432"
45212600-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u0430\u0432\u0438\u043B\u044C\u043E\u043D\u043E\u0432"
45213000-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043E\u043C\u043C\u0435\u0440\u0447\u0435\u0441\u043A\u0438\u0445 \u0437\u0434\u0430\u043D\u0438\u0439, \u0441\u043A\u043B\u0430\u0434\u043E\u0432 \u0438 \u043F\u0440\u043E\u043C\u044B\u0448\u043B\u0435\u043D\u043D\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439, \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u043E\u0439 \u0434\u0435\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u0438"
45213100-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043E\u043C\u043C\u0435\u0440\u0447\u0435\u0441\u043A\u0438\u0445 \u0437\u0434\u0430\u043D\u0438\u0439"
45213110-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043C\u0430\u0433\u0430\u0437\u0438\u043D\u043E\u0432"
45213111-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u043E\u0440\u0433\u043E\u0432\u044B\u0445 \u0446\u0435\u043D\u0442\u0440\u043E\u0432"
45213112-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043D\u0435\u0431\u043E\u043B\u044C\u0448\u0438\u0445 \u043C\u0430\u0433\u0430\u0437\u0438\u043D\u043E\u0432"
45213120-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043E\u0442\u0434\u0435\u043B\u0435\u043D\u0438\u0439 \u043F\u043E\u0447\u0442\u043E\u0432\u043E\u0439 \u0441\u0432\u044F\u0437\u0438"
45213130-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0431\u0430\u043D\u043A\u043E\u0432"
45213140-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0440\u044B\u043D\u043A\u043E\u0432"
45213141-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u0440\u044B\u0442\u044B\u0445 \u0440\u044B\u043D\u043A\u043E\u0432"
45213142-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0440\u044B\u043D\u043A\u043E\u0432 \u043F\u043E\u0434 \u043E\u0442\u043A\u0440\u044B\u0442\u044B\u043C \u043D\u0435\u0431\u043E\u043C"
45213150-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043E\u0444\u0438\u0441\u043D\u044B\u0445 \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043E\u0432"
45213200-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u043A\u043B\u0430\u0434\u043E\u0432 \u0438 \u043F\u0440\u043E\u043C\u044B\u0448\u043B\u0435\u043D\u043D\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439"
45213210-8: "\u0425\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u044B\u0435 \u0441\u043A\u043B\u0430\u0434\u044B"
45213220-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u043A\u043B\u0430\u0434\u043E\u0432"
45213221-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u043A\u043B\u0430\u0434\u043E\u0432-\u043C\u0430\u0433\u0430\u0437\u0438\u043D\u043E\u0432"
45213230-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0431\u043E\u0439\u043D\u0438"
45213240-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u0435\u043B\u044C\u0441\u043A\u043E\u0445\u043E\u0437\u044F\u0439\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439"
45213241-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u043C\u0431\u0430\u0440\u043E\u0432"
45213242-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043E\u043D\u044E\u0448\u0435\u043D"
45213250-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u0440\u043E\u043C\u044B\u0448\u043B\u0435\u043D\u043D\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439"
45213251-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u0440\u043E\u043C\u044B\u0448\u043B\u0435\u043D\u043D\u044B\u0445 \u0437\u0434\u0430\u043D\u0438\u0439"
45213252-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u0442\u0435\u043B\u044C\u0435"
45213260-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u043E\u0432\u0430\u0440\u043D\u044B\u0445 \u0441\u043A\u043B\u0430\u0434\u043E\u0432"
45213270-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0430\u0432\u043E\u0434\u043E\u0432 \u043F\u043E \u0443\u0442\u0438\u043B\u0438\u0437\u0430\u0446\u0438\u0438"
45213280-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0430\u0432\u043E\u0434\u043E\u0432 \u043A\u043E\u043C\u043F\u043E\u0441\u0442\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F"
45213300-6: "\u0417\u0434\u0430\u043D\u0438\u044F \u0434\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u043E\u0439 \u0434\u0435\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u0438"
45213310-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0438\u043B\u044C\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0430"
45213311-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u0432\u0442\u043E\u0431\u0443\u0441\u043D\u044B\u0445 \u043E\u0441\u0442\u0430\u043D\u043E\u0432\u043E\u043A"
45213312-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043C\u043D\u043E\u0433\u043E\u044D\u0442\u0430\u0436\u043D\u044B\u0445 \u0430\u0432\u0442\u043E\u0441\u0442\u043E\u044F\u043D\u043E\u043A"
45213313-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u0437\u043E\u043D \u043E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u044F"
45213314-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u0432\u0442\u043E\u0431\u0443\u0441\u043D\u044B\u0445 \u043F\u0430\u0440\u043A\u043E\u0432"
45213315-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u0440\u044B\u0442\u044B\u0445 \u0430\u0432\u0442\u043E\u0431\u0443\u0441\u043D\u044B\u0445 \u043E\u0441\u0442\u0430\u043D\u043E\u0432\u043E\u043A"
45213316-1: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043C\u043E\u043D\u0442\u0430\u0436\u0443 \u043F\u0435\u0440\u0435\u0445\u043E\u0434\u043E\u0432"
45213320-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0438 \u0441\u043E\u043E\u0440\u0443\u0436\u0435\u043D\u0438\u0439 \u0434\u043B\u044F \u0436\u0435\u043B\u0435\u0437\u043D\u043E\u0434\u043E\u0440\u043E\u0436\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0430"
45213321-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0436\u0435\u043B\u0435\u0437\u043D\u043E\u0434\u043E\u0440\u043E\u0436\u043D\u044B\u0445 \u0432\u043E\u043A\u0437\u0430\u043B\u043E\u0432"
45213322-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0436\u0435\u043B\u0435\u0437\u043D\u043E\u0434\u043E\u0440\u043E\u0436\u043D\u044B\u0445 \u0442\u0435\u0440\u043C\u0438\u043D\u0430\u043B\u043E\u0432"
45213330-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u0432\u043E\u0437\u0434\u0443\u0448\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0430"
45213331-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u0430\u044D\u0440\u043E\u043F\u043E\u0440\u0442\u043E\u0432"
45213332-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E  \u0434\u0438\u0441\u043F\u0435\u0442\u0447\u0435\u0440\u0441\u043A\u0438\u0445 \u043F\u0443\u043D\u043A\u0442\u043E\u0432 \u0434\u043B\u044F \u0430\u044D\u0440\u043E\u043F\u043E\u0440\u0442\u043E\u0432"
45213333-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0431\u044E\u0440\u043E \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u0432 \u0430\u044D\u0440\u043E\u043F\u043E\u0440\u0442\u0443 (\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u044F)"
45213340-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439, \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u044B\u0445 \u0441 \u0432\u043E\u0434\u043D\u044B\u043C \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043E\u043C"
45213341-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043A\u043E\u0433\u043E \u043F\u043E\u0440\u0442\u0430"
45213342-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0440\u043E\u043B\u043A\u0435\u0440\u043D\u044B\u0445 \u0442\u0435\u0440\u043C\u0438\u043D\u0430\u043B\u043E\u0432"
45213350-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0438 \u0441\u043E\u043E\u0440\u0443\u0436\u0435\u043D\u0438\u0439 \u0434\u043B\u044F \u0440\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u0445 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u044B\u0445 \u0441\u0440\u0435\u0434\u0441\u0442\u0432"
45213351-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u043D\u0433\u0430\u0440\u0430 \u0434\u043B\u044F \u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u044F"
45213352-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u0435\u0440\u0432\u0438\u0441\u043D\u044B\u0445 \u0434\u0435\u043F\u043E"
45213353-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u0435\u0440\u0435\u0445\u043E\u0434\u043E\u0432 \u0434\u043B\u044F \u043F\u043E\u0433\u0440\u0443\u0437\u043A\u0438 \u043F\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043E\u0432"
45213400-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043E\u043C\u043D\u0430\u0442 \u0434\u043B\u044F \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u043B\u0430"
45214000-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043E\u0431\u0440\u0430\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0445 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043D\u0438\u0439 \u0438 \u043D\u0430\u0443\u0447\u043D\u044B\u0445 \u0446\u0435\u043D\u0442\u0440\u043E\u0432"
45214100-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0434\u0435\u0442\u0441\u043A\u0438\u0445 \u0441\u0430\u0434\u043E\u0432"
45214200-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0448\u043A\u043E\u043B\u044C\u043D\u044B\u0445 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043D\u0438\u0439"
45214210-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043D\u0430\u0447\u0430\u043B\u044C\u043D\u044B\u0445 \u0448\u043A\u043E\u043B"
45214220-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u0440\u0435\u0434\u043D\u0438\u0445 \u0448\u043A\u043E\u043B"
45214230-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u043F\u0435\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0445 \u0448\u043A\u043E\u043B"
45214300-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u044B\u0441\u0448\u0438\u0445 \u0443\u0447\u0435\u0431\u043D\u044B\u0445 \u0437\u0430\u0432\u0435\u0434\u0435\u043D\u0438\u0439"
45214310-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u0443\u0447\u0438\u043B\u0438\u0449"
45214320-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0443\u0447\u0438\u043B\u0438\u0449"
45214400-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0443\u043D\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0441\u043A\u0438\u0445 \u0437\u0430\u0432\u0435\u0434\u0435\u043D\u0438\u0439"
45214410-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u043E\u043B\u0438\u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0438\u043D\u0441\u0442\u0438\u0442\u0443\u0442\u043E\u0432"
45214420-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u043C\u0444\u0438\u0442\u0435\u0430\u0442\u0440\u043E\u0432"
45214430-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043B\u0438\u043D\u0433\u0430\u0444\u043E\u043D\u043D\u044B\u0445 \u043A\u0430\u0431\u0438\u043D\u0435\u0442\u043E\u0432"
45214500-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0443\u0447\u0435\u0431\u043D\u044B\u0445 \u0446\u0435\u043D\u0442\u0440\u043E\u0432"
45214600-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043D\u0430\u0443\u0447\u043D\u043E-\u0438\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u0441\u043A\u0438\u0445 \u0446\u0435\u043D\u0442\u0440\u043E\u0432"
45214610-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u043B\u0430\u0431\u043E\u0440\u0430\u0442\u043E\u0440\u0438\u0439"
45214620-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043E\u0431\u044A\u0435\u043A\u0442\u043E\u0432 \u0434\u043B\u044F \u0438\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043D\u0438\u0439 \u0438 \u044D\u043A\u0441\u043F\u0435\u0440\u0438\u043C\u0435\u043D\u0442\u043E\u0432"
45214630-5: "\u041D\u0430\u0443\u0447\u043D\u044B\u0435 \u043E\u0431\u044A\u0435\u043A\u0442\u044B"
45214631-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0447\u0438\u0441\u0442\u044B\u0445 \u043F\u043E\u043C\u0435\u0449\u0435\u043D\u0438\u0439"
45214640-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043C\u0435\u0442\u0435\u043E\u0440\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0441\u0442\u0430\u043D\u0446\u0438\u0439"
45214700-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0443\u043D\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0441\u043A\u0438\u0445 \u043A\u0430\u043C\u043F\u0443\u0441\u043E\u0432 (\u0433\u043E\u0440\u043E\u0434\u043A\u043E\u0432)"
45214710-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u0435\u0441\u0442\u0438\u0431\u044E\u043B\u0435\u0439"
45214800-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0434\u043B\u044F \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043E\u0431\u0443\u0447\u0435\u043D\u0438\u044F"
45215000-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u0445 \u0438 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0445 \u0443\u0441\u043B\u0443\u0433, \u0434\u043B\u044F \u043A\u0440\u0435\u043C\u0430\u0442\u043E\u0440\u0438\u0435\u0432 \u0438 \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0445 \u0442\u0443\u0430\u043B\u0435\u0442\u043E\u0432"
45215100-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0434\u043B\u044F \u0441\u043B\u0443\u0436\u0431 \u0437\u0434\u0440\u0430\u0432\u043E\u043E\u0445\u0440\u0430\u043D\u0435\u043D\u0438\u044F"
45215110-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0435\u043F\u043B\u043E\u0432\u044B\u0445 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0438\u0439"
45215120-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0434\u0430\u043D\u0438\u0439 \u0438 \u0441\u043E\u043E\u0440\u0443\u0436\u0435\u043D\u0438\u0439 \u0434\u043B\u044F \u0441\u043F\u0435\u0446\u0438\u0430\u043B\u0438\u0437\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u044B\u0445 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u0445 \u0443\u0441\u043B\u0443\u0433"
45215130-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043B\u0438\u043D\u0438\u043A"
45215140-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0431\u043E\u043B\u044C\u043D\u0438\u0447\u043D\u044B\u0445 \u043E\u0442\u0434\u0435\u043B\u0435\u043D\u0438\u0439"
