45221117-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u043E\u0434\u0432\u0435\u0441\u043D\u044B\u0445 \u043C\u043E\u0441\u0442\u043E\u0432"
45221118-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043C\u043E\u0441\u0442\u043E\u0432 \u0434\u043B\u044F \u043F\u0440\u043E\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u043D\u0438\u044F \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45221119-9: "\u0420\u0435\u043C\u043E\u043D\u0442\u043D\u043E-\u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043D\u0430 \u043C\u043E\u0441\u0442\u0430\u0445"
45221120-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u0438\u0430\u0434\u0443\u043A\u043E\u0432 (\u043C\u043E\u0441\u0442\u043E\u0432 \u043D\u0430\u0434 \u0437\u0435\u043C\u043B\u0435\u0439)"
45221121-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0438\u043B\u044C\u043D\u044B\u0445 \u0432\u0438\u0430\u0434\u0443\u043A\u043E\u0432 (\u043C\u043E\u0441\u0442\u043E\u0432 \u043D\u0430\u0434 \u0437\u0435\u043C\u043B\u0435\u0439)"
45221122-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0436\u0435\u043B\u0435\u0437\u043D\u043E\u0434\u043E\u0440\u043E\u0436\u043D\u044B\u0445 \u0432\u0438\u0430\u0434\u0443\u043A\u043E\u0432 (\u043C\u043E\u0441\u0442\u043E\u0432 \u043D\u0430\u0434 \u0437\u0435\u043C\u043B\u0435\u0439)"
45221200-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u043E\u043D\u043D\u0435\u043B\u0435\u0439, \u0448\u0430\u0445\u0442 \u0438 \u043C\u0435\u0442\u0440\u043E"
45221210-7: "\u0420\u0430\u0441\u043A\u043E\u043F\u043A\u0438 \u043F\u043E\u043A\u0440\u044B\u0442\u044B\u0435 \u0438\u043B\u0438 \u0447\u0430\u0441\u0442\u0438\u0447\u043D\u043E \u043F\u043E\u043A\u0440\u044B\u0442\u044B\u0435"
45221211-4: "\u041F\u043E\u0434\u0437\u0435\u043C\u043D\u044B\u0435 \u043F\u0435\u0440\u0435\u0441\u0435\u0447\u0435\u043D\u0438\u044F (\u0434\u043E\u0440\u043E\u0433, \u0440\u0435\u043A \u0438 \u0442.\u0434.)"
45221213-8: "\u041F\u043E\u0434\u0437\u0435\u043C\u043D\u044B\u0435 \u0438\u043B\u0438 \u0447\u0430\u0441\u0442\u0438\u0447\u043D\u043E \u043F\u043E\u0434\u0437\u0435\u043C\u043D\u044B\u0435 \u0436\u0435\u043B\u0435\u0437\u043D\u043E\u0434\u043E\u0440\u043E\u0436\u043D\u044B\u0435 \u043F\u0443\u0442\u0438"
45221214-5: "\u041F\u043E\u0434\u0437\u0435\u043C\u043D\u044B\u0435 \u0438\u043B\u0438 \u0447\u0430\u0441\u0442\u0438\u0447\u043D\u043E \u043F\u043E\u0434\u0437\u0435\u043C\u043D\u044B\u0435 \u0430\u0432\u0442\u043E\u0441\u0442\u0440\u0430\u0434\u044B"
45221220-0: "\u0412\u043E\u0434\u043E\u043F\u0440\u043E\u043F\u0443\u0441\u043A\u043D\u044B\u0435 \u0441\u043E\u043E\u0440\u0443\u0436\u0435\u043D\u0438\u044F"
45221230-3: "\u0421\u043A\u0432\u0430\u0436\u0438\u043D\u044B, \u0448\u0430\u0445\u0442\u044B"
45221240-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u043E\u043D\u043D\u0435\u043B\u0435\u0439"
45221241-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u0432\u0442\u043E\u0434\u043E\u0440\u043E\u0436\u043D\u044B\u0445 \u0442\u0443\u043D\u043D\u0435\u043B\u0435\u0439"
45221242-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0436\u0435\u043B\u0435\u0437\u043D\u043E\u0434\u043E\u0440\u043E\u0436\u043D\u044B\u0445 \u0442\u043E\u043D\u043D\u0435\u043B\u0435\u0439"
45221243-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u043E\u043D\u043D\u0435\u043B\u0435\u0439 \u0434\u043B\u044F \u043F\u0435\u0448\u0435\u0445\u043E\u0434\u043E\u0432"
45221244-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0443\u043D\u043D\u0435\u043B\u0435\u0439 \u0434\u043B\u044F \u043A\u0430\u043D\u0430\u043B\u043E\u0432"
45221245-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u043E\u043D\u043D\u0435\u043B\u0435\u0439 \u043F\u043E\u0434 \u0440\u0435\u043A\u0430\u043C\u0438"
45221246-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u043E\u043D\u043D\u0435\u043B\u0435\u0439 \u043F\u043E\u0434 \u043C\u043E\u0440\u0435\u043C"
45221247-5: "\u041F\u0440\u043E\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u043D\u0438\u0435 \u0442\u0443\u043D\u043D\u0435\u043B\u0435\u0439"
45221248-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u043A\u0440\u0435\u043F\u043B\u0435\u043D\u0438\u044E \u0442\u043E\u043D\u043D\u0435\u043B\u0435\u0439"
45221250-9: "\u041F\u043E\u0434\u0437\u0435\u043C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B, \u043A\u0440\u043E\u043C\u0435 \u0442\u043E\u043D\u043D\u0435\u043B\u0435\u0439, \u0448\u0430\u0445\u0442 \u0438 \u043C\u0435\u0442\u0440\u043E"
45222000-9: "\u041E\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0435 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E, \u043A\u0440\u043E\u043C\u0435 \u043C\u043E\u0441\u0442\u043E\u0432, \u0448\u0430\u0445\u0442 \u0438 \u043C\u0435\u0442\u0440\u043E"
45222100-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0430\u0432\u043E\u0434\u043E\u0432 \u043F\u043E \u043F\u0435\u0440\u0435\u0440\u0430\u0431\u043E\u0442\u043A\u0435 \u043E\u0442\u0445\u043E\u0434\u043E\u0432"
45222110-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u0432\u0430\u043B\u043E\u043A"
45222200-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u043E\u0435\u043D\u043D\u044B\u0445 \u043E\u0431\u044A\u0435\u043A\u0442\u043E\u0432"
45222300-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043E\u0445\u0440\u0430\u043D\u043D\u044B\u0445 \u0441\u043E\u043E\u0440\u0443\u0436\u0435\u043D\u0438\u0439"
45223000-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u0442\u0440\u0443\u043A\u0442\u0443\u0440\u043D\u044B\u0445 \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u0439"
45223100-7: "\u041C\u043E\u043D\u0442\u0430\u0436 \u043C\u0435\u0442\u0430\u043B\u043B\u043E\u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u0439"
45223110-0: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u043C\u0435\u0442\u0430\u043B\u043B\u043E\u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u0439"
45223200-8: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u044F\u043C"
45223210-1: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043C\u0435\u0442\u0430\u043B\u043B\u043E\u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u044F\u043C"
45223220-4: "\u041E\u0441\u043D\u043E\u0432\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45223300-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u0430\u0440\u043A\u043E\u0432\u043E\u043A"
45223310-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u043E\u0434\u0437\u0435\u043C\u043D\u044B\u0445 \u043F\u0430\u0440\u043A\u043E\u0432\u043E\u043A"
45223320-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u0432\u0442\u043E\u0441\u0442\u043E\u044F\u043D\u043A\u0438 \u0442\u0438\u043F\u0430 \u043F\u0435\u0440\u0435\u0445\u0432\u0430\u0442\u044B\u0432\u0430\u044E\u0449\u0430\u044F \u043F\u0430\u0440\u043A\u043E\u0432\u043A\u0430\" \""
45223400-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0440\u0430\u0434\u0438\u043E\u043B\u043E\u043A\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0445 \u0441\u0442\u0430\u043D\u0446\u0438\u0439"
45223500-1: "\u0416\u0435\u043B\u0435\u0437\u043E\u0431\u0435\u0442\u043E\u043D\u043D\u044B\u0435 \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u0438"
45223600-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043B\u0435\u0442\u043E\u043A \u0434\u043B\u044F \u0441\u043E\u0431\u0430\u043A"
45223700-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u043E\u043D \u043E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u044F"
45223710-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u0432\u0442\u043E\u0434\u043E\u0440\u043E\u0436\u043D\u044B\u0445 \u0437\u043E\u043D \u043E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u044F"
45223720-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0437\u0430\u043F\u0440\u0430\u0432\u043E\u0447\u043D\u044B\u0445 \u0441\u0442\u0430\u043D\u0446\u0438\u0439"
45223800-4: "\u041C\u043E\u043D\u0442\u0430\u0436 \u0438 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0441\u0431\u043E\u0440\u043D\u044B\u0445 \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u0439"
45223810-7: "\u0411\u044B\u0441\u0442\u0440\u043E\u0432\u043E\u0437\u0432\u043E\u0434\u0438\u043C\u044B\u0435 \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u0438"
45223820-0: "\u0421\u0431\u043E\u0440\u043D\u044B\u0435 \u044D\u043B\u0435\u043C\u0435\u043D\u0442\u044B \u0438 \u043A\u043E\u043C\u043F\u043E\u043D\u0435\u043D\u0442\u044B"
45223821-7: "\u0421\u0431\u043E\u0440\u043D\u044B\u0435 \u044D\u043B\u0435\u043C\u0435\u043D\u0442\u044B"
45223822-4: "\u0421\u0431\u043E\u0440\u043D\u044B\u0435 \u043A\u043E\u043C\u043F\u043E\u043D\u0435\u043D\u0442\u044B"
45230000-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432, \u043B\u0438\u043D\u0438\u0439 \u0441\u0432\u044F\u0437\u0438 \u0438 \u043B\u0438\u043D\u0438\u0439 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447, \u043C\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u043B\u0435\u0439, \u0434\u043E\u0440\u043E\u0433, \u0430\u044D\u0440\u043E\u0434\u0440\u043E\u043C\u043E\u0432 \u0438 \u0436\u0435\u043B\u0435\u0437\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433; \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0432\u044B\u0440\u0430\u0432\u043D\u0438\u0432\u0430\u044E"
45231000-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432, \u043B\u0438\u043D\u0438\u0439 \u0441\u0432\u044F\u0437\u0438 \u0438 \u043B\u0438\u043D\u0438\u0439 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447"
45231100-6: "\u041E\u0431\u0449\u0435\u0435 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45231110-9: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u043A\u043B\u0430\u0434\u043A\u0435 \u0442\u0440\u0443\u0431"
45231111-6: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0441\u043D\u044F\u0442\u0438\u044E \u0438 \u0437\u0430\u043C\u0435\u043D\u0435 \u0442\u0440\u0443\u0431"
45231112-3: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043D\u043E\u0439 \u0441\u0435\u0442\u0438"
45231113-0: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0437\u0430\u043C\u0435\u043D\u0435 \u0442\u0440\u0443\u0431"
45231200-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043D\u0435\u0444\u0442\u0435\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432 \u0438 \u0433\u0430\u0437\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45231210-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043D\u0435\u0444\u0442\u0435\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45231220-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0433\u0430\u0437\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45231221-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432 \u0434\u043B\u044F \u043F\u043E\u0441\u0442\u0430\u0432\u043E\u043A \u0433\u0430\u0437\u0430"
45231222-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0433\u0430\u0437\u0433\u043E\u043B\u044C\u0434\u0435\u0440\u043E\u0432"
45231223-4: "\u0413\u0430\u0437\u043E\u0440\u0430\u0441\u043F\u0440\u0435\u0434\u0435\u043B\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0432\u0441\u043F\u043E\u043C\u043E\u0433\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45231300-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0434\u043B\u0438\u043D\u043D\u044B\u0445 \u0432\u043E\u0434\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432 \u0438 \u043A\u0430\u043D\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0439"
45231400-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043B\u0438\u043D\u0438\u0439 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447"
45231500-0: "\u0422\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u044B \u0434\u043B\u044F \u0441\u0436\u0430\u0442\u043E\u0433\u043E \u0432\u043E\u0437\u0434\u0443\u0445\u0430"
45231510-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u043D\u0435\u0432\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u043F\u043E\u0447\u0442\u044B"
45231600-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043B\u0438\u043D\u0438\u0439 \u0441\u0432\u044F\u0437\u0438"
45232000-2: "\u0412\u0441\u043F\u043E\u043C\u043E\u0433\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u0434\u043B\u044F \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432 \u0438 \u043A\u0430\u0431\u0435\u043B\u0435\u0439"
45232100-3: "\u0412\u0441\u043F\u043E\u043C\u043E\u0433\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u0434\u043B\u044F \u0432\u043E\u0434\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45232120-9: "\u0418\u0440\u0440\u0438\u0433\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45232121-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0438\u0440\u0440\u0438\u0433\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0445 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45232130-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432 \u0434\u043B\u044F \u0441\u0442\u043E\u043A\u0430 \u0434\u043E\u0436\u0434\u0435\u0432\u044B\u0445 \u0432\u043E\u0434"
45232140-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0435\u043F\u043B\u043E\u0442\u0440\u0430\u0441\u0441"
45232141-2: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u043E\u0442\u043E\u043F\u043B\u0435\u043D\u0438\u044F"
45232142-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0435\u043F\u043B\u043E\u0432\u044B\u0445 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0438\u0439"
45232150-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u043E\u0434\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45232151-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u043E-\u0440\u0435\u043C\u043E\u043D\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0432\u043E\u0434\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0430\u043C"
45232152-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043D\u0430\u0441\u043E\u0441\u043D\u044B\u0445 \u0441\u0442\u0430\u043D\u0446\u0438\u0439"
45232153-9: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0443 \u0432\u043E\u0434\u043E\u043D\u0430\u043F\u043E\u0440\u043D\u044B\u0445 \u0431\u0430\u0448\u0435\u043D"
45232154-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u043E\u0434\u043D\u044F\u0442\u044B\u0445 \u0435\u043C\u043A\u043E\u0441\u0442\u0435\u0439 \u0434\u043B\u044F \u0432\u043E\u0434\u044B"
45232200-4: "\u0412\u0441\u043F\u043E\u043C\u043E\u0433\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u0434\u043B\u044F \u043B\u0438\u043D\u0438\u0439 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447\u0438"
45232210-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u043E\u0437\u0434\u0443\u0448\u043D\u044B\u0445 \u043B\u0438\u043D\u0438\u0439 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447\u0438"
45232220-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0440\u0430\u043D\u0441\u0444\u043E\u0440\u043C\u0430\u0442\u043E\u0440\u043D\u044B\u0445 \u0441\u0442\u0430\u043D\u0446\u0438\u0439"
45232221-7: "\u0422\u0440\u0430\u043D\u0441\u0444\u043E\u0440\u043C\u0430\u0442\u043E\u0440\u043D\u0430\u044F \u043F\u043E\u0434\u0441\u0442\u0430\u043D\u0446\u0438\u044F"
45232300-5: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0443 \u043B\u0438\u043D\u0438\u0439 \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u043D\u043E\u0439 \u0441\u0432\u044F\u0437\u0438, \u043B\u0438\u043D\u0438\u0439 \u0441\u0432\u044F\u0437\u0438 \u0438 \u0432\u0441\u043F\u043E\u043C\u043E\u0433\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45232310-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043B\u0438\u043D\u0438\u0439 \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u043D\u043E\u0439 \u0441\u0432\u044F\u0437\u0438"
45232311-5: "\u0423\u043B\u0438\u0447\u043D\u044B\u0435 \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u043D\u044B\u0435 \u043B\u0438\u043D\u0438\u0438 \u0434\u043B\u044F \u0430\u0432\u0430\u0440\u0438\u0439\u043D\u044B\u0445 \u0437\u0432\u043E\u043D\u043A\u043E\u0432"
45232320-1: "\u041B\u0438\u043D\u0438\u0438 \u043A\u0430\u0431\u0435\u043B\u044C\u043D\u043E\u0433\u043E \u0432\u0435\u0449\u0430\u043D\u0438\u044F"
45232330-4: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0430\u043D\u0442\u0435\u043D\u043D"
45232331-1: "\u0412\u0435\u0449\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0432\u0441\u043F\u043E\u043C\u043E\u0433\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45232332-8: "\u0422\u0435\u043B\u0435\u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0435 \u0432\u0441\u043F\u043E\u043C\u043E\u0433\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45232340-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0431\u0430\u0437\u043E\u0432\u044B\u0445 \u0441\u0442\u0430\u043D\u0446\u0438\u0439 \u043C\u043E\u0431\u0438\u043B\u044C\u043D\u043E\u0439 \u0441\u0432\u044F\u0437\u0438"
45232400-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u0430\u043D\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0445 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432 \u0434\u043B\u044F \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u0432\u043E\u0434"
45232410-9: "\u041C\u0435\u043B\u0438\u043E\u0440\u0430\u0442\u0438\u0432\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45232411-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u0430\u043D\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0445 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432 \u0434\u043B\u044F \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u0432\u043E\u0434"
45232420-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u0442\u0430\u043D\u0446\u0438\u0439 \u0434\u043B\u044F \u043E\u0447\u0438\u0441\u0442\u043A\u0438 \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u0432\u043E\u0434"
45232421-9: "\u0421\u0442\u0430\u043D\u0446\u0438\u044F \u043E\u0447\u0438\u0441\u0442\u043A\u0438 \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u0432\u043E\u0434"
45232422-6: "\u0421\u0442\u0430\u043D\u0446\u0438\u044F \u043E\u0447\u0438\u0441\u0442\u043A\u0438 \u0448\u043B\u0430\u043C\u0430"
45232423-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043D\u0430\u0441\u043E\u0441\u043D\u044B\u0445 \u0441\u0442\u0430\u043D\u0446\u0438\u0439 \u0434\u043B\u044F \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u0432\u043E\u0434"
45232424-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u0430\u043D\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u0434\u043B\u044F \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u0432\u043E\u0434"
45232430-5: "\u0423\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430 \u043E\u0431\u0440\u0430\u0431\u043E\u0442\u043A\u0438 \u0432\u043E\u0434"
45232431-2: "\u041A\u0430\u043D\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0435 \u043D\u0430\u0441\u043E\u0441\u043D\u044B\u0435 \u0441\u0442\u0430\u043D\u0446\u0438\u0438"
45232440-8: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0443 \u043A\u0430\u043D\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0445 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45232450-1: "\u0414\u0440\u0435\u043D\u0430\u0436\u043D\u044B\u0435 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45232451-8: "\u0414\u0440\u0435\u043D\u0430\u0436\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u0438 \u043F\u043E\u0432\u0435\u0440\u0445\u043D\u043E\u0441\u0442\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45232452-5: "\u0414\u0440\u0435\u043D\u0430\u0436\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45232453-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u043A\u0430\u043D\u0430\u043B\u043E\u0432"
45232454-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0431\u0430\u0441\u0441\u0435\u0439\u043D\u043E\u0432  \u0434\u043B\u044F \u0434\u043E\u0436\u0434\u0435\u0432\u043E\u0439 \u0432\u043E\u0434\u044B"
45232460-4: "\u0421\u0430\u043D\u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45232470-7: "\u0421\u0442\u0430\u043D\u0446\u0438\u044F \u043F\u0435\u0440\u0435\u043A\u0430\u0447\u043A\u0438 \u043E\u0442\u0445\u043E\u0434\u043E\u0432"
45233000-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E, \u0443\u043A\u043B\u0430\u0434\u043A\u0430 \u0444\u0443\u043D\u0434\u0430\u043C\u0435\u043D\u0442\u043E\u0432 \u0438 \u0434\u043E\u0440\u043E\u0436\u043D\u043E\u0433\u043E \u0438 \u0443\u043B\u0438\u0447\u043D\u043E\u0433\u043E \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044F"
45233100-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0430\u0432\u0442\u043E\u0441\u0442\u0440\u0430\u0434 \u0438 \u0434\u043E\u0440\u043E\u0433"
45233110-3: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0443 \u0430\u0432\u0442\u043E\u0441\u0442\u0440\u0430\u0434"
45233120-6: "\u0414\u043E\u0440\u043E\u0436\u043D\u043E\u0435 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E"
45233121-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043C\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433"
45233122-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u043E\u043B\u044C\u0446\u0435\u0432\u044B\u0445 \u0434\u043E\u0440\u043E\u0433"
45233123-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u0442\u043E\u0440\u043E\u0441\u0442\u0435\u043F\u0435\u043D\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433"
45233124-4: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0433\u043B\u0430\u0432\u043D\u044B\u0445 \u043C\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433"
45233125-1: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u044B\u0445 \u0440\u0430\u0437\u0432\u044F\u0437\u043E\u043A"
45233126-8: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0440\u0430\u0437\u043D\u043E\u0443\u0440\u043E\u0432\u043D\u0435\u0432\u044B\u0445 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u044B\u0445 \u0440\u0430\u0437\u0432\u044F\u0437\u043E\u043A"
45233127-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0422-\u043E\u0431\u0440\u0430\u0437\u043D\u044B\u0445 \u043F\u0435\u0440\u0435\u043A\u0440\u0435\u0441\u0442\u043A\u043E\u0432"
45233128-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043A\u0440\u0443\u0433\u043E\u0432\u044B\u0445 \u0434\u0432\u0438\u0436\u0435\u043D\u0438\u0439"
45233129-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u0435\u0440\u0435\u043A\u0440\u0435\u0441\u0442\u043A\u043E\u0432"
45233130-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043D\u0430\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433"
45233131-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043D\u0430\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433 \u043D\u0430 \u043D\u0430\u0441\u044B\u043F\u044F\u0445"
45233139-3: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u044E \u043D\u0430\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433"
45233140-2: "\u0414\u043E\u0440\u043E\u0436\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45233141-9: "\u0422\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u043E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u0435 \u0434\u043E\u0440\u043E\u0433"
45233142-6: "\u0420\u0435\u043C\u043E\u043D\u0442 \u0434\u043E\u0440\u043E\u0433"
45233144-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u044D\u0441\u0442\u0430\u043A\u0430\u0434"
45233150-5: "\u0420\u0430\u0431\u043E\u0442\u044B \u0434\u043B\u044F \u0443\u043C\u0435\u043D\u044C\u0448\u0435\u043D\u0438\u044F \u0442\u0440\u0430\u0444\u0438\u043A\u0430"
45233160-8: "\u0414\u043E\u0440\u043E\u0433\u0438 \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u043F\u043E\u0432\u0435\u0440\u0445\u043D\u043E\u0441\u0442\u0438 \u0441 \u0442\u0432\u0435\u0440\u0434\u044B\u043C \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u0435\u043C"
45233161-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0440\u043E\u0442\u0443\u0430\u0440\u043E\u0432"
45233162-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0432\u0435\u043B\u043E\u0441\u0438\u043F\u0435\u0434\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0436\u0435\u043A"
45233200-1: "\u0420\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044E"
45233210-4: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u043A\u043B\u0430\u0434\u043A\u0435 \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044F \u0430\u0432\u0442\u043E\u0441\u0442\u0440\u0430\u0434"
45233220-7: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u043A\u043B\u0430\u0434\u043A\u0435 \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044F \u0434\u043E\u0440\u043E\u0433"
45233221-4: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043F\u0440\u043E\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u043D\u0438\u044E \u0434\u043E\u0440\u043E\u0436\u043D\u043E\u0439 \u0440\u0430\u0437\u043C\u0435\u0442\u043A\u0438"
45233222-1: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043C\u043E\u0449\u0435\u043D\u0438\u044E \u0438 \u0430\u0441\u0444\u0430\u043B\u044C\u0442\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044E"
45233223-8: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043E\u0431\u043D\u043E\u0432\u043B\u0435\u043D\u0438\u044E \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044F \u0448\u043E\u0441\u0441\u0435\u0439\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433"
45233224-5: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0434\u043E\u0440\u043E\u0433 \u0441 \u0434\u0432\u0443\u043C\u044F \u043F\u043E\u043B\u043E\u0441\u0430\u043C\u0438 \u0434\u0432\u0438\u0436\u0435\u043D\u0438\u044F \u0432 \u043A\u0430\u0436\u0434\u043E\u043C \u043D\u0430\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u0438 \u0434\u0432\u0438\u0436\u0435\u043D\u0438\u044F"
45233225-2: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0434\u043E\u0440\u043E\u0433\u0438 \u0441 \u043E\u0434\u043D\u043E\u0439 \u043F\u043E\u043B\u043E\u0441\u043E\u0439 \u0434\u0432\u0438\u0436\u0435\u043D\u0438\u044F \u0432 \u043A\u0430\u0436\u0434\u043E\u043C \u043D\u0430\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u0438 \u0434\u0432\u0438\u0436\u0435\u043D\u0438\u044F"
45233226-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043F\u043E\u0434\u044A\u0435\u0437\u0434\u043D\u044B\u0445 \u043F\u0443\u0442\u0435\u0439"
45233227-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043E\u0431\u044A\u0435\u0437\u0434\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433"
45233228-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u043A\u043B\u0430\u0434\u043A\u0435 \u043F\u043E\u0432\u0435\u0440\u0445\u043D\u043E\u0441\u0442\u043D\u043E\u0433\u043E \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044F"
45233229-0: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u044E \u043E\u0431\u043E\u0447\u0438\u043D"
45233250-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u043A\u043B\u0430\u0434\u043A\u0435 \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044F, \u043A\u0440\u043E\u043C\u0435 \u0434\u043E\u0440\u043E\u0436\u043D\u043E\u0433\u043E \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044F"
45233251-3: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043E\u0431\u043D\u043E\u0432\u043B\u0435\u043D\u0438\u044E \u0434\u043E\u0440\u043E\u0436\u043D\u043E\u0433\u043E \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044F"
45233252-0: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u043A\u043B\u0430\u0434\u043A\u0435 \u0443\u043B\u0438\u0447\u043D\u043E\u0433\u043E \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044F"
45233253-7: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u043A\u043B\u0430\u0434\u043A\u0435 \u0442\u0440\u043E\u0442\u0443\u0430\u0440\u043D\u043E\u0433\u043E \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044F"
45233260-9: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0434\u043E\u0440\u043E\u0436\u0435\u043A \u0434\u043E\u0441\u0442\u0443\u043F\u0430 \u0434\u043B\u044F \u043F\u0435\u0448\u0435\u0445\u043E\u0434\u043E\u0432"
45233261-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u044D\u0441\u0442\u0430\u043A\u0430\u0434 \u0434\u043B\u044F \u043F\u0435\u0448\u0435\u0445\u043E\u0434\u043E\u0432"
45233262-3: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0443\u043A\u0440\u044B\u0442\u0438\u0439 \u0434\u043B\u044F \u043F\u0435\u0448\u0435\u0445\u043E\u0434\u043E\u0432"
45233270-2: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043C\u0430\u0440\u043A\u0438\u0440\u043E\u0432\u043A\u0435 \u043F\u0430\u0440\u043A\u043E\u0432\u043E\u0447\u043D\u044B\u0445 \u0437\u043E\u043D"
45233280-5: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0434\u043E\u0440\u043E\u0436\u043D\u043E\u0433\u043E \u043E\u0433\u0440\u0430\u0436\u0434\u0435\u043D\u0438\u044F"
45233290-8: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0434\u043E\u0440\u043E\u0436\u043D\u044B\u0445 \u0437\u043D\u0430\u043A\u043E\u0432"
45233291-5: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u043E\u0433\u0440\u0430\u0434\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0445 \u0441\u0442\u043E\u043B\u0431\u0438\u043A\u043E\u0432"
45233292-2: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0437\u0430\u0449\u0438\u0442\u043D\u044B\u0445 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432"
45233293-9: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0443\u043B\u0438\u0447\u043D\u043E\u0439 \u043C\u0435\u0431\u0435\u043B\u0438"
45233294-6: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0434\u043E\u0440\u043E\u0436\u043D\u044B\u0445 \u0441\u0438\u0433\u043D\u0430\u043B\u0438\u0437\u0430\u0442\u043E\u0440\u043E\u0432"
45233300-2: "\u0423\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u043D\u0438\u0435 \u0444\u0443\u043D\u0434\u0430\u043C\u0435\u043D\u0442\u043E\u0432 \u0434\u043B\u044F \u0430\u0432\u0442\u043E\u043C\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u043B\u0435\u0439, \u0434\u043E\u0440\u043E\u0433, \u0443\u043B\u0438\u0446 \u0438 \u0442\u0440\u043E\u0442\u0443\u0430\u0440\u043E\u0432"
45233310-5: "\u0423\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u043D\u0438\u0435 \u0444\u0443\u043D\u0434\u0430\u043C\u0435\u043D\u0442\u043E\u0432 \u0434\u043B\u044F \u0430\u0432\u0442\u043E\u043C\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u043B\u0435\u0439"
45233320-8: "\u0423\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u043D\u0438\u0435 \u0444\u0443\u043D\u0434\u0430\u043C\u0435\u043D\u0442\u043E\u0432 \u0434\u043B\u044F \u0448\u043E\u0441\u0441\u0435\u0439\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433"
45233330-1: "\u0423\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u043D\u0438\u0435 \u0444\u0443\u043D\u0434\u0430\u043C\u0435\u043D\u0442\u043E\u0432 \u0434\u043B\u044F \u0434\u043E\u0440\u043E\u0433"
45233340-4: "\u0423\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u043D\u0438\u0435 \u0444\u0443\u043D\u0434\u0430\u043C\u0435\u043D\u0442\u043E\u0432 \u0434\u043B\u044F \u0442\u0440\u043E\u0442\u0443\u0430\u0440\u043E\u0432"
45234000-6: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0436\u0435\u043B\u0435\u0437\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433 \u0438 \u043A\u0430\u0431\u0435\u043B\u044C\u043D\u044B\u0445 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u044B\u0445 \u0441\u0438\u0441\u0442\u0435\u043C"
45234100-7: "\u0421\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0436\u0435\u043B\u0435\u0437\u043D\u044B\u0445 \u0434\u043E\u0440\u043E\u0433"
45234110-0: "\u041F\u0440\u0438\u0433\u043E\u0440\u043E\u0434\u043D\u044B\u0435 \u0436\u0435\u043B\u0435\u0437\u043D\u044B\u0435 \u0434\u043E\u0440\u043E\u0433\u0438"
