45316220-3: "\u041C\u043E\u043D\u0442\u0430\u0436 \u0441\u0438\u0433\u043D\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0432 \u0430\u044D\u0440\u043E\u043F\u043E\u0440\u0442\u0430\u0445"
45316230-6: "\u041C\u043E\u043D\u0442\u0430\u0436 \u0441\u0438\u0433\u043D\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0432 \u043F\u043E\u0440\u0442\u0430\u0445"
45317000-2: "\u0414\u0440\u0443\u0433\u0438\u0435 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043C\u043E\u043D\u0442\u0430\u0436\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45317100-3: "\u042D\u043B\u0435\u043A\u0442\u0440\u043E\u043C\u043E\u043D\u0442\u0430\u0436\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u043D\u0430\u0441\u043E\u0441\u043D\u043E\u043C\u0443 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044E"
45317200-4: "\u042D\u043B\u0435\u043A\u0442\u0440\u043E\u043C\u043E\u043D\u0442\u0430\u0436\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0442\u0440\u0430\u043D\u0441\u0444\u043E\u0440\u043C\u0430\u0442\u043E\u0440\u0430\u043C"
45317300-5: "\u042D\u043B\u0435\u043A\u0442\u0440\u043E\u043C\u043E\u043D\u0442\u0430\u0436\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0440\u0430\u0441\u043F\u0440\u0435\u0434\u0435\u043B\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u043C \u0430\u043F\u043F\u0430\u0440\u0430\u0442\u0430\u043C"
45317400-6: "\u042D\u043B\u0435\u043A\u0442\u0440\u043E\u043C\u043E\u043D\u0442\u0430\u0436\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0444\u0438\u043B\u044C\u0442\u0440\u0430\u0446\u0438\u043E\u043D\u043D\u043E\u043C\u0443 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044E"
45320000-6: "\u0418\u0437\u043E\u043B\u044F\u0446\u0438\u043E\u043D\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45321000-3: "\u0422\u0435\u043F\u043B\u043E\u0438\u0437\u043E\u043B\u044F\u0446\u0438\u043E\u043D\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45323000-7: "\u0417\u0432\u0443\u043A\u043E\u0438\u0437\u043E\u043B\u044F\u0446\u0438\u043E\u043D\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45324000-4: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0433\u0438\u043F\u0441\u043E\u0432\u043E\u043C\u0443 \u043F\u043E\u043A\u0440\u044B\u0442\u0438\u044E"
45330000-9: "\u0421\u0430\u043D\u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45331000-6: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0441\u0438\u0441\u0442\u0435\u043C \u043E\u0442\u043E\u043F\u043B\u0435\u043D\u0438\u044F, \u0432\u0435\u043D\u0442\u0438\u043B\u044F\u0446\u0438\u0438 \u0438 \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430"
45331100-7: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0446\u0435\u043D\u0442\u0440\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043E\u0442\u043E\u043F\u043B\u0435\u043D\u0438\u044F"
45331110-0: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043A\u043E\u0442\u043B\u043E\u0432"
45331200-8: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0434\u043B\u044F \u0432\u0435\u043D\u0442\u0438\u043B\u044F\u0446\u0438\u0438 \u0438 \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430"
45331210-1: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0434\u043B\u044F \u0432\u0435\u043D\u0442\u0438\u043B\u044F\u0446\u0438\u0438"
45331211-8: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0441\u0438\u0441\u0442\u0435\u043C \u043D\u0430\u0440\u0443\u0436\u043D\u043E\u0439 \u0432\u0435\u043D\u0442\u0438\u043B\u044F\u0446\u0438\u0438"
45331220-4: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0434\u043B\u044F \u0441\u0438\u0441\u0442\u0435\u043C \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430"
45331221-1: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0434\u043B\u044F \u0447\u0430\u0441\u0442\u0438\u0447\u043D\u043E\u0433\u043E \u043A\u043E\u043D\u0434\u0438\u0446\u0438\u043E\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0432\u043E\u0437\u0434\u0443\u0445\u0430"
45331230-7: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0445\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u043E\u0433\u043E \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F"
45331231-4: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043C\u043E\u0440\u043E\u0437\u0438\u043B\u044C\u043D\u043E\u0433\u043E \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F"
45332000-3: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0441\u0430\u043D\u0442\u0435\u0445\u043D\u0438\u043A\u0438 \u0438 \u043A\u0430\u043D\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u0438 \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45332200-5: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0434\u043B\u044F \u0432\u043E\u0434\u043E\u0441\u043D\u0430\u0431\u0436\u0435\u043D\u0438\u044F"
45332300-6: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u043E\u0432"
45332400-7: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0441\u0430\u043D\u0442\u0435\u0445\u043D\u0438\u043A\u0438"
45333000-0: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0433\u0430\u0437\u043E\u0432\u043E\u0433\u043E \u043E\u0431\u043E\u0440\u0443\u0434\u043E\u0432\u0430\u043D\u0438\u044F"
45333100-1: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0433\u0430\u0437\u043E\u0432\u044B\u0445 \u0440\u0435\u0433\u0443\u043B\u044F\u0442\u043E\u0440\u043E\u0432"
45333200-2: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0433\u0430\u0437\u043E\u0432\u044B\u0445 \u0441\u0447\u0435\u0442\u0447\u0438\u043A\u043E\u0432"
45340000-2: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043E\u0433\u0440\u0430\u0436\u0434\u0435\u043D\u0438\u044F, \u043F\u0435\u0440\u0438\u043B \u0438 \u0437\u0430\u0449\u0438\u0442\u043D\u044B\u0445 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432"
45341000-9: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043F\u043E\u0440\u0443\u0447\u043D\u0435\u0439"
45342000-6: "\u0412\u043E\u0437\u0432\u0435\u0434\u0435\u043D\u0438\u0435 \u043E\u0433\u0440\u0430\u0436\u0434\u0435\u043D\u0438\u044F"
45343000-3: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043F\u0440\u043E\u0442\u0438\u0432\u043E\u043F\u043E\u0436\u0430\u0440\u043D\u044B\u0445 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432"
45343100-4: "\u041F\u0440\u043E\u0442\u0438\u0432\u043E\u043F\u043E\u0436\u0430\u0440\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45343200-5: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432 \u0434\u043B\u044F \u0442\u0443\u0448\u0435\u043D\u0438\u044F \u043F\u043E\u0436\u0430\u0440\u043E\u0432"
45343210-8: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432 \u0434\u043B\u044F \u0442\u0443\u0448\u0435\u043D\u0438\u044F \u043F\u043E\u0436\u0430\u0440\u043E\u0432 \u0441 \u043F\u043E\u043C\u043E\u0449\u044C\u044E \u0443\u0433\u043B\u0435\u043A\u0438\u0441\u043B\u043E\u0433\u043E \u0433\u0430\u0437\u0430"
45343220-1: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u043E\u0433\u043D\u0435\u0442\u0443\u0448\u0438\u0442\u0435\u043B\u0435\u0439"
45343230-4: "\u0420\u0430\u0431\u043E\u0442\u044B \u043F\u043E \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0441\u043F\u0440\u0438\u043D\u043A\u043B\u0435\u0440\u043D\u044B\u0445 \u0441\u0438\u0441\u0442\u0435\u043C \u043F\u043E\u0436\u0430\u0440\u043E\u0442\u0443\u0448\u0435\u043D\u0438\u044F"
45350000-5: "\u041C\u043E\u043D\u0442\u0430\u0436\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45351000-2: "\u041C\u043E\u043D\u0442\u0430\u0436\u043D\u044B\u0435 \u0438\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45400000-1: "\u041E\u0442\u0434\u0435\u043B\u043E\u0447\u043D\u044B\u0435 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45410000-4: "\u0428\u0442\u0443\u043A\u0430\u0442\u0443\u0440\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45420000-7: "\u0421\u0442\u043E\u043B\u044F\u0440\u043D\u044B\u0435 \u0438 \u043F\u043B\u043E\u0442\u043D\u0438\u0446\u043A\u0438\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45421000-4: "\u0421\u0442\u043E\u043B\u044F\u0440\u043D\u044B\u0435 \u0440\u0430\u0431\u043E\u0442\u044B"
45421100-5: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0434\u0432\u0435\u0440\u0435\u0439, \u043E\u043A\u043E\u043D \u0438 \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u044B\u0445 \u0441 \u043D\u0438\u043C \u043A\u043E\u043C\u043F\u043E\u043D\u0435\u043D\u0442\u043E\u0432"
45421110-8: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0434\u0432\u0435\u0440\u043D\u044B\u0445 \u043A\u043E\u0440\u043E\u0431\u043E\u043A \u0438 \u043E\u043A\u043E\u043D\u043D\u044B\u0445 \u0440\u0430\u043C"
45421111-5: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0434\u0432\u0435\u0440\u043D\u044B\u0445 \u043A\u043E\u0440\u043E\u0431\u043E\u043A"
45421112-2: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u043E\u043A\u043E\u043D\u043D\u044B\u0445 \u0440\u0430\u043C"
45421120-1: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u043F\u043E\u0440\u043E\u0433\u043E\u0432"
45421130-4: "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430 \u0434\u0432\u0435\u0440\u0435\u0439 \u0438 \u043E\u043A\u043E\u043D"
