85111200-2: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u0445 \u0441\u0442\u0430\u0446\u0438\u043E\u043D\u0430\u0440\u043E\u0432"
85111300-3: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0433\u0438\u043D\u0435\u043A\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0441\u0442\u0430\u0446\u0438\u043E\u043D\u0430\u0440\u043E\u0432"
85111310-6: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u044D\u043A\u0441\u0442\u0440\u0430\u043A\u043E\u0440\u043F\u043E\u0440\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043E\u043F\u043B\u043E\u0434\u043E\u0442\u0432\u043E\u0440\u0435\u043D\u0438\u044F"
85111320-9: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0430\u043A\u0443\u0448\u0435\u0440\u0441\u043A\u0438\u0445 \u0441\u0442\u0430\u0446\u0438\u043E\u043D\u0430\u0440\u043E\u0432"
85111400-4: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0441\u0442\u0430\u0446\u0438\u043E\u043D\u0430\u0440\u043E\u0432 \u0440\u0435\u0430\u0431\u0438\u043B\u0438\u0442\u0430\u0446\u0438\u0438"
85111500-5: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u0441\u0438\u0445\u0438\u0430\u0442\u0440\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0441\u0442\u0430\u0446\u0438\u043E\u043D\u0430\u0440\u043E\u0432"
85111600-6: "\u041E\u0440\u0442\u043E\u043F\u0435\u0434\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85111700-7: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043E\u043A\u0441\u0438\u0433\u0435\u043D\u043E\u0442\u0435\u0440\u0430\u043F\u0438\u0438"
85111800-8: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043F\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u0430\u043D\u0430\u0442\u043E\u043C\u0438\u0438"
85111810-1: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0430\u043D\u0430\u043B\u0438\u0437\u043E\u0432 \u043A\u0440\u043E\u0432\u0438"
85111820-4: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0431\u0430\u043A\u0442\u0435\u0440\u0438\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0430\u043D\u0430\u043B\u0438\u0437\u043E\u0432"
85111900-9: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0434\u0438\u0430\u043B\u0438\u0437\u0430 \u0432 \u0443\u0441\u043B\u043E\u0432\u0438\u044F\u0445 \u0441\u0442\u0430\u0446\u0438\u043E\u043D\u0430\u0440\u0430"
85112000-7: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0431\u043E\u043B\u044C\u043D\u0438\u0447\u043D\u043E\u0439 \u0438\u043D\u0444\u0440\u0430\u0441\u0442\u0440\u0443\u043A\u0442\u0443\u0440\u044B"
85112100-8: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043A\u0430\u0441\u0430\u044E\u0449\u0438\u0435\u0441\u044F \u0433\u043E\u0441\u043F\u0438\u0442\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043F\u043E\u0441\u0442\u0435\u043B\u044C\u043D\u043E\u0433\u043E \u0438\u043C\u0443\u0449\u0435\u0441\u0442\u0432\u0430"
85112200-9: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0430\u043C\u0431\u0443\u043B\u0430\u0442\u043E\u0440\u043D\u043E\u0439 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u043E\u0439 \u043F\u043E\u043C\u043E\u0449\u0438"
85120000-6: "\u0412\u0440\u0430\u0447\u0435\u0431\u043D\u0430\u044F \u043F\u0440\u0430\u043A\u0442\u0438\u043A\u0430 \u0438 \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u044B\u0435 \u0441 \u043D\u0435\u0439 \u0443\u0441\u043B\u0443\u0433\u0438"
85121000-3: "\u0412\u0440\u0430\u0447\u0435\u0431\u043D\u0430\u044F \u043F\u0440\u0430\u043A\u0442\u0438\u043A\u0430"
85121100-4: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u0432\u0440\u0430\u0447\u0430\u043C\u0438 \u043E\u0431\u0449\u0435\u0439 \u043F\u0440\u0430\u043A\u0442\u0438\u043A\u0438"
85121200-5: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B \u0432\u0440\u0430\u0447\u0430\u043C\u0438 \u0443\u0437\u043A\u0438\u0445 \u0441\u043F\u0435\u0446\u0438\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0439"
85121210-8: "\u0410\u043A\u0443\u0448\u0435\u0440\u0441\u043A\u0438\u0435 \u0438\u043B\u0438 \u0433\u0438\u043D\u0435\u043A\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85121220-1: "\u041D\u0435\u0444\u0440\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0438\u043B\u0438 \u043D\u0435\u0432\u0440\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85121230-4: "\u041A\u0430\u0440\u0434\u0438\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438 \u0438\u043B\u0438 \u0443\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u043F\u0443\u043B\u044C\u043C\u043E\u043D\u043E\u043B\u043E\u0433\u0430\u043C\u0438"
85121231-1: "\u041A\u0430\u0440\u0434\u0438\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85121232-8: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u043F\u0443\u043B\u044C\u043C\u043E\u043D\u043E\u043B\u043E\u0433\u0430\u043C\u0438"
85121240-7: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043E\u0442\u043E\u0440\u0438\u043D\u043E\u043B\u0430\u0440\u0438\u043D\u0433\u043E\u043B\u043E\u0433\u0438\u0438 \u0438\u043B\u0438 \u0430\u0443\u0434\u0438\u043E\u043B\u043E\u0433\u0438\u0438"
85121250-0: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0433\u0430\u0441\u0442\u0440\u043E\u044D\u043D\u0442\u0435\u0440\u043E\u043B\u043E\u0433\u0438\u0438 \u0438 \u0433\u0435\u0440\u0438\u0430\u0442\u0440\u0438\u0438"
85121251-7: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0433\u0430\u0441\u0442\u0440\u043E\u044D\u043D\u0442\u0435\u0440\u043E\u043B\u043E\u0433\u0438\u0438"
85121252-4: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0433\u0435\u0440\u0438\u0430\u0442\u0440\u0438\u0438"
85121270-6: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043F\u0441\u0438\u0445\u0438\u0430\u0442\u0440\u0438\u0438 \u0438\u043B\u0438 \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0438\u0438"
85121271-3: "\u041E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u0435 \u043D\u0430 \u0434\u043E\u043C\u0443 \u043B\u044E\u0434\u0435\u0439 \u0441 \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u043C\u0438 \u0440\u0430\u0441\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430\u043C\u0438"
85121280-9: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043E\u0444\u0442\u0430\u043B\u044C\u043C\u043E\u043B\u043E\u0433\u0438\u0438, \u0434\u0435\u0440\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0438 \u0438\u043B\u0438 \u043E\u0440\u0442\u043E\u043F\u0435\u0434\u0438\u0438"
85121281-6: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043E\u0444\u0442\u0430\u043B\u044C\u043C\u043E\u043B\u043E\u0433\u0438\u0438"
85121282-3: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0434\u0435\u0440\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0438"
85121283-0: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043E\u0440\u0442\u043E\u043F\u0435\u0434\u0438\u0438"
85121290-2: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043F\u0435\u0434\u0438\u0430\u0442\u0440\u0438\u0438 \u0438\u043B\u0438 \u0443\u0440\u043E\u043B\u043E\u0433\u0438\u0438"
85121291-9: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043F\u0435\u0434\u0438\u0430\u0442\u0440\u0438\u0438"
85121292-6: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0443\u0440\u043E\u043B\u043E\u0433\u0438\u0438"
85121300-6: "\u0421\u043F\u0435\u0446\u0438\u0430\u043B\u0438\u0437\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u044B\u0435 \u0445\u0438\u0440\u0443\u0440\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85130000-9: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438 \u0438 \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u044B\u0435 \u0441 \u043D\u0438\u043C\u0438 \u0443\u0441\u043B\u0443\u0433\u0438"
85131000-6: "\u0421\u0442\u043E\u043C\u0430\u0442\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85131100-7: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043E\u0440\u0442\u043E\u0434\u043E\u043D\u0442\u0438\u0438"
85131110-0: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043E\u0440\u0442\u043E\u0434\u043E\u043D\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u0445\u0438\u0440\u0443\u0440\u0433\u0438\u0438"
85140000-2: "\u0420\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u0435 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85141000-9: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u043C\u044B\u0435 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u043C \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u043B\u043E\u043C"
85141100-0: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u043C\u044B\u0435 \u0430\u043A\u0443\u0448\u0435\u0440\u043A\u0430\u043C\u0438"
85141200-1: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u0441\u0435\u0441\u0442\u0440\u0438\u043D\u0441\u043A\u0438\u043C \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u043C \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u043B\u043E\u043C"
85141210-4: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u043E\u043C\u0443 \u0443\u0445\u043E\u0434\u0443 \u043D\u0430 \u0434\u043E\u043C\u0443"
85141211-1: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E  \u043B\u0435\u0447\u0435\u043D\u0438\u044E \u0434\u0438\u0430\u043B\u0438\u0437\u043E\u043C \u043D\u0430 \u0434\u043E\u043C\u0443"
85141220-7: "\u041A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0442\u0438\u0432\u043D\u044B\u0435 \u0443\u0441\u043B\u0443\u0433\u0438, \u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u043C\u044B\u0435 \u0441\u0435\u0441\u0442\u0440\u0438\u043D\u0441\u043A\u0438\u043C \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u043C \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u043B\u043E\u043C"
85142000-6: "\u041F\u0430\u0440\u0430\u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85142100-7: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0444\u0438\u0437\u0438\u043E\u0442\u0435\u0440\u0430\u043F\u0438\u0438"
85142200-8: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0433\u043E\u043C\u0435\u043E\u043F\u0430\u0442\u0438\u0438"
85142300-9: "\u0421\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E-\u0433\u0438\u0433\u0438\u0435\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85142400-0: "\u0414\u043E\u0441\u0442\u0430\u0432\u043A\u0430 \u043D\u0430 \u0434\u043E\u043C \u0442\u043E\u0432\u0430\u0440\u043E\u0432 \u0434\u043B\u044F \u043B\u044E\u0434\u0435\u0439 \u0441 \u043D\u0435\u0434\u0435\u0440\u0436\u0430\u043D\u0438\u0435\u043C"
85143000-3: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0441\u043A\u043E\u0440\u043E\u0439 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u043E\u0439 \u043F\u043E\u043C\u043E\u0449\u0438"
85144000-0: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0446\u0435\u043D\u0442\u0440\u043E\u0432 \u0441\u0435\u043C\u0435\u0439\u043D\u043E\u0439 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u044B"
85144100-1: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0446\u0435\u043D\u0442\u0440\u043E\u0432 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u043E\u0439 \u043F\u043E\u043C\u043E\u0449\u0438"
85145000-7: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u043C\u0438 \u043B\u0430\u0431\u043E\u0440\u0430\u0442\u043E\u0440\u0438\u044F\u043C\u0438"
85146000-4: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u0431\u0430\u043D\u043A\u0430\u043C\u0438 \u043A\u0440\u043E\u0432\u0438"
85146100-5: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u0431\u0430\u043D\u043A\u0430\u043C\u0438 \u0441\u043F\u0435\u0440\u043C\u044B"
85146200-6: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u0431\u0430\u043D\u043A\u0430\u043C\u0438 \u043E\u0440\u0433\u0430\u043D\u043E\u0432 \u0434\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043B\u0430\u043D\u0442\u0430\u0446\u0438\u0438"
85147000-1: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u044B \u0442\u0440\u0443\u0434\u0430"
85148000-8: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u0445 \u0430\u043D\u0430\u043B\u0438\u0437\u043E\u0432"
85149000-5: "\u0424\u0430\u0440\u043C\u0430\u0446\u0435\u0432\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85150000-5: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u043E\u0439 \u0438\u043C\u0430\u0436\u0438\u0441\u0442\u0438\u043A\u0438 (\u0440\u0435\u043D\u0442\u0433\u0435\u043D, \u0423\u0417\u0418 \u0438 \u0442.\u0434.)"
85160000-8: "\u041E\u043F\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85170000-1: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0430\u043A\u0443\u043F\u0443\u043D\u043A\u0442\u0443\u0440\u044B \u0438 \u0445\u0438\u0440\u043E\u043F\u0440\u0430\u043A\u0441\u0438\u0438"
85171000-8: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0430\u043A\u0443\u043F\u0443\u043D\u043A\u0442\u0443\u0440\u044B"
85172000-5: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0445\u0438\u0440\u043E\u043F\u0440\u0430\u043A\u0441\u0438\u0438"
85200000-1: "\u0412\u0435\u0442\u0435\u0440\u0438\u043D\u0430\u0440\u043D\u044B\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85210000-3: "\u0417\u0430\u0432\u043E\u0434\u0447\u0438\u043A\u0438 \u0434\u043E\u043C\u0430\u0448\u043D\u0438\u0445 \u0436\u0438\u0432\u043E\u0442\u043D\u044B\u0445"
85300000-2: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438 \u0438 \u0441\u043E\u043F\u0443\u0442\u0441\u0442\u0432\u0443\u044E\u0449\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
85310000-5: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438"
85311000-2: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438 \u0441 \u043E\u0431\u0435\u0441\u043F\u0435\u0447\u0435\u043D\u0438\u0435\u043C \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u043D\u0438\u044F"
85311100-3: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438 \u0434\u043B\u044F \u043F\u043E\u0436\u0438\u043B\u044B\u0445 \u043B\u044E\u0434\u0435\u0439"
85311200-4: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438 \u0434\u043B\u044F \u043B\u044E\u0434\u0435\u0439 \u0441 \u043E\u0433\u0440\u0430\u043D\u0438\u0447\u0435\u043D\u043D\u044B\u043C\u0438 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044F\u043C\u0438, \u0438\u043D\u0432\u0430\u043B\u0438\u0434\u043E\u0432"
85311300-5: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438 \u0434\u043B\u044F \u0434\u0435\u0442\u0435\u0439 \u0438 \u043F\u043E\u0434\u0440\u043E\u0441\u0442\u043A\u043E\u0432"
85312000-9: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438 \u0431\u0435\u0437 \u043E\u0431\u0435\u0441\u043F\u0435\u0447\u0435\u043D\u0438\u044F \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u043D\u0438\u044F"
85312100-0: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0446\u0435\u043D\u0442\u0440\u043E\u0432 \u0434\u043D\u0435\u0432\u043D\u043E\u0433\u043E \u0443\u0445\u043E\u0434\u0430"
85312110-3: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u0446\u0435\u043D\u0442\u0440\u0430\u043C\u0438 \u0434\u043D\u0435\u0432\u043D\u043E\u0433\u043E \u0443\u0445\u043E\u0434\u0430 \u0434\u043B\u044F \u0434\u0435\u0442\u0435\u0439"
85312120-6: "\u0423\u0441\u043B\u0443\u0433\u0438, \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u0446\u0435\u043D\u0442\u0440\u0430\u043C\u0438 \u0434\u043D\u0435\u0432\u043D\u043E\u0433\u043E \u0443\u0445\u043E\u0434\u0430 \u0434\u043B\u044F \u0434\u0435\u0442\u0435\u0439 \u0438 \u043C\u043E\u043B\u043E\u0434\u0435\u0436\u0438 \u0441 \u043E\u0433\u0440\u0430\u043D\u0438\u0447\u0435\u043D\u043D\u044B\u043C\u0438 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044F\u043C\u0438"
85312200-1: "\u0414\u043E\u0441\u0442\u0430\u0432\u043A\u0430 \u043F\u0438\u0449\u0435\u0432\u044B\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u043E\u0432 \u043D\u0430 \u0434\u043E\u043C"
85312300-2: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0440\u0443\u043A\u043E\u0432\u043E\u0434\u0441\u0442\u0432\u0430 \u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u043A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0446\u0438\u0439"
85312310-5: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0440\u0443\u043A\u043E\u0432\u043E\u0434\u0441\u0442\u0432\u0430"
85312320-8: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u043A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0446\u0438\u0439"
85312330-1: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043F\u043B\u0430\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0441\u0435\u043C\u044C\u0438"
85312400-3: "\u0421\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0435 \u0443\u0441\u043B\u0443\u0433\u0438, \u043D\u0435 \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u043C\u044B\u0435 \u0436\u0438\u043B\u044B\u043C\u0438 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043D\u0438\u044F\u043C\u0438"
85312500-4: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0440\u0435\u0430\u0431\u0438\u043B\u0438\u0442\u0430\u0446\u0438\u0438"
85312510-7: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0439 \u0440\u0435\u0430\u0431\u0438\u043B\u0438\u0442\u0430\u0446\u0438\u0438"
