90522400-6: "\u041E\u0447\u0438\u0441\u0442\u043A\u0430 \u0438 \u043E\u0431\u0440\u0430\u0431\u043E\u0442\u043A\u0430 \u043F\u043E\u0447\u0432\u044B"
90523000-9: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0442\u0438\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u0442\u043E\u043A\u0441\u0438\u0447\u043D\u044B\u0445 \u043E\u0442\u0445\u043E\u0434\u043E\u0432, \u0437\u0430 \u0438\u0441\u043A\u043B\u044E\u0447\u0435\u043D\u0438\u0435\u043C \u0440\u0430\u0434\u0438\u043E\u0430\u043A\u0442\u0438\u0432\u043D\u044B\u0445 \u043E\u0442\u0445\u043E\u0434\u043E\u0432 \u0438 \u0437\u0430\u0440\u0430\u0436\u0435\u043D\u043D\u044B\u0445 \u043F\u043E\u0447\u0432"
90523100-0: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0442\u0438\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u043E\u0440\u0443\u0436\u0438\u044F \u0438 \u0431\u043E\u0435\u043F\u0440\u0438\u043F\u0430\u0441\u043E\u0432"
90523200-1: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043E\u0431\u0435\u0437\u0432\u0440\u0435\u0436\u0438\u0432\u0430\u043D\u0438\u044E \u0431\u043E\u043C\u0431"
90523300-2: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043E\u0431\u043D\u0430\u0440\u0443\u0436\u0435\u043D\u0438\u044E \u0438 \u043E\u0431\u0435\u0437\u0432\u0440\u0435\u0436\u0438\u0432\u0430\u043D\u0438\u044E \u043C\u0438\u043D"
90524000-6: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u043C\u0435\u0434\u0438\u0446\u0438\u043D\u0441\u043A\u0438\u0445 \u043E\u0442\u0445\u043E\u0434\u043E\u0432"
90524100-7: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0431\u043E\u0440\u043A\u0435 \u0431\u043E\u043B\u044C\u043D\u0438\u0447\u043D\u044B\u0445 \u043E\u0442\u0445\u043E\u0434\u043E\u0432"
90524200-8: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0442\u0438\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u0431\u043E\u043B\u044C\u043D\u0438\u0447\u043D\u044B\u0445 \u043E\u0442\u0445\u043E\u0434\u043E\u0432"
90524300-9: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0434\u0430\u043B\u0435\u043D\u0438\u044E \u0431\u0438\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043E\u0442\u0445\u043E\u0434\u043E\u0432"
90524400-0: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0431\u043E\u0440\u043A\u0435, \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0438\u0440\u043E\u0432\u043A\u0435 \u0438 \u0443\u0442\u0438\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u0431\u043E\u043B\u044C\u043D\u0438\u0447\u043D\u044B\u0445 \u043E\u0442\u0445\u043E\u0434\u043E\u0432"
90530000-1: "\u042D\u043A\u0441\u043F\u043B\u0443\u0430\u0442\u0430\u0446\u0438\u044F \u043F\u043E\u043B\u0438\u0433\u043E\u043D\u043E\u0432 \u0434\u043B\u044F  \u0437\u0430\u0445\u043E\u0440\u043E\u043D\u0435\u043D\u0438\u044F \u043E\u0442\u0445\u043E\u0434\u043E\u0432"
90531000-8: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u044E \u043F\u043E\u043B\u0438\u0433\u043E\u043D\u0430\u043C\u0438 \u0434\u043B\u044F \u0437\u0430\u0445\u043E\u0440\u043E\u043D\u0435\u043D\u0438\u044F \u043E\u0442\u0445\u043E\u0434\u043E\u0432"
90532000-5: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u044E \u0443\u0433\u043E\u043B\u044C\u043D\u044B\u043C\u0438 \u043A\u0443\u0447\u0430\u043C\u0438"
90533000-2: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u044E \u043C\u0443\u0441\u043E\u0440\u043D\u044B\u043C\u0438 \u043A\u0443\u0447\u0430\u043C\u0438"
90600000-3: "\u041E\u0447\u0438\u0441\u0442\u043D\u044B\u0435 \u0438 \u0441\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u044B\u0435 \u0443\u0441\u043B\u0443\u0433\u0438 \u0432 \u0433\u043E\u0440\u043E\u0434\u0441\u043A\u043E\u0439 \u0438\u043B\u0438 \u0441\u0435\u043B\u044C\u0441\u043A\u043E\u0439 \u043C\u0435\u0441\u0442\u043D\u043E\u0441\u0442\u0438 \u0438 \u0441\u043E\u043F\u0443\u0442\u0441\u0442\u0432\u0443\u044E\u0449\u0438\u0435 \u0443\u0441\u043B\u0443\u0433\u0438"
90610000-6: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0431\u043E\u0440\u043A\u0435 \u0438 \u043F\u043E\u0434\u043C\u0435\u0442\u0430\u043D\u0438\u044E \u0443\u043B\u0438\u0446"
90611000-3: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0431\u043E\u0440\u043A\u0435 \u0443\u043B\u0438\u0446"
90612000-0: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043F\u043E\u0434\u043C\u0435\u0442\u0430\u043D\u0438\u044E \u0443\u043B\u0438\u0446"
90620000-9: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0431\u043E\u0440\u043A\u0435 \u0441\u043D\u0435\u0433\u0430"
90630000-2: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0431\u043E\u0440\u043A\u0435 \u043B\u044C\u0434\u0430"
90640000-5: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043E\u0447\u0438\u0441\u0442\u043A\u0435 \u0438 \u043E\u0441\u0432\u043E\u0431\u043E\u0436\u0434\u0435\u043D\u0438\u044E \u043A\u0430\u043D\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0445 \u043B\u044E\u043A\u043E\u0432, \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u043B\u044E\u043A\u043E\u0432"
90641000-2: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043E\u0447\u0438\u0441\u0442\u043A\u0435 \u0443\u0441\u0442\u044C\u0435\u0432 \u043A\u0430\u043D\u0430\u043B\u043E\u0432"
90642000-9: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043E\u0441\u0432\u043E\u0431\u043E\u0436\u0434\u0435\u043D\u0438\u044E \u0443\u0441\u0442\u044C\u0435\u0432 \u043A\u0430\u043D\u0430\u043B\u043E\u0432"
90650000-8: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0434\u0430\u043B\u0435\u043D\u0438\u044E \u0448\u0438\u0444\u0435\u0440\u0430"
90660000-1: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0442\u0438\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u0441\u0432\u0438\u043D\u0446\u0430"
90670000-4: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0434\u0435\u0437\u0438\u043D\u0444\u0435\u043A\u0446\u0438\u0438 \u0438 \u0434\u0435\u0437\u0438\u043D\u0441\u0435\u043A\u0446\u0438\u0438 \u0433\u043E\u0440\u043E\u0434\u0441\u043A\u043E\u0439 \u0438 \u0441\u0435\u043B\u044C\u0441\u043A\u043E\u0439 \u043C\u0435\u0441\u0442\u043D\u043E\u0441\u0442\u0438"
90680000-7: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043E\u0447\u0438\u0441\u0442\u043A\u0435 \u043F\u043B\u044F\u0436\u0435\u0439"
90690000-0: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0443\u0434\u0430\u043B\u0435\u043D\u0438\u044E \u0433\u0440\u0430\u0444\u0444\u0438\u0442\u0438"
90700000-4: "\u0423\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u044D\u043A\u043E\u043B\u043E\u0433\u0438\u0438"
90710000-7: "\u042D\u043A\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u043C\u0435\u043D\u0435\u0434\u0436\u043C\u0435\u043D\u0442"
90711000-4: "\u041E\u0446\u0435\u043D\u043A\u0430 \u0432\u043E\u0437\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F \u043D\u0430 \u043E\u043A\u0440\u0443\u0436\u0430\u044E\u0449\u0443\u044E \u0441\u0440\u0435\u0434\u0443, \u043E\u0442\u043B\u0438\u0447\u043D\u043E\u0433\u043E \u043E\u0442 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0433\u043E \u0432\u043E\u0437\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F"
90711100-5: "\u041E\u0446\u0435\u043D\u043A\u0430 \u0440\u0438\u0441\u043A\u043E\u0432 \u0438 \u043E\u043F\u0430\u0441\u043D\u043E\u0441\u0442\u0435\u0439, \u043E\u0442\u043B\u0438\u0447\u043D\u044B\u0445 \u043E\u0442 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0445"
90711200-6: "\u042D\u043A\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0441\u0442\u0430\u043D\u0434\u0430\u0440\u0442\u044B, \u043E\u0442\u043B\u0438\u0447\u043D\u044B\u0435 \u043E\u0442 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0445"
90711300-7: "\u0410\u043D\u0430\u043B\u0438\u0437 \u044D\u043A\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043F\u043E\u043A\u0430\u0437\u0430\u0442\u0435\u043B\u0435\u0439, \u043E\u0442\u043B\u0438\u0447\u043D\u044B\u0445 \u043E\u0442 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0445"
90711400-8: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043E\u0446\u0435\u043D\u043A\u0435 \u0432\u043E\u0437\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F \u043D\u0430 \u043E\u043A\u0440\u0443\u0436\u0430\u044E\u0449\u0443\u044E \u0441\u0440\u0435\u0434\u0443, \u043E\u0442\u043B\u0438\u0447\u043D\u044B\u0435 \u043E\u0442 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0433\u043E \u0432\u043E\u0437\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F"
90711500-9: "\u041C\u043E\u043D\u0438\u0442\u043E\u0440\u0438\u043D\u0433 \u043E\u043A\u0440\u0443\u0436\u0430\u044E\u0449\u0435\u0439 \u0441\u0440\u0435\u0434\u044B, \u043E\u0442\u043B\u0438\u0447\u043D\u044B\u0439 \u043E\u0442 \u043C\u043E\u043D\u0438\u0442\u043E\u0440\u0438\u043D\u0433\u0430 \u043F\u0440\u0438 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0435"
90712000-1: "\u042D\u043A\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u043F\u043B\u0430\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435"
90712100-2: "\u041F\u043B\u0430\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044F \u0433\u043E\u0440\u043E\u0434\u0441\u043A\u043E\u0439 \u0441\u0440\u0435\u0434\u044B"
90712200-3: "\u041F\u043B\u0430\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435 \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0438\u0438 \u0441\u043E\u0445\u0440\u0430\u043D\u0435\u043D\u0438\u044F \u043B\u0435\u0441\u043E\u0432"
90712300-4: "\u041F\u043B\u0430\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435 \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0438\u0438 \u0441\u043E\u0445\u0440\u0430\u043D\u0435\u043D\u0438\u044F \u043C\u043E\u0440\u0441\u043A\u043E\u0439 \u0441\u0440\u0435\u0434\u044B"
90712400-5: "\u0423\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043F\u043B\u0430\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044E \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0438\u0438 \u0443\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u044F \u0438\u043B\u0438 \u0441\u043E\u0445\u0440\u0430\u043D\u0435\u043D\u0438\u044F \u043F\u0440\u0438\u0440\u043E\u0434\u043D\u044B\u0445 \u0440\u0435\u0441\u0443\u0440\u0441\u043E\u0432"
90712500-6: "\u0421\u043E\u0437\u0434\u0430\u043D\u0438\u0435 \u0438\u043B\u0438 \u043F\u043B\u0430\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435 \u043F\u0440\u0438\u0440\u043E\u0434\u043E\u043E\u0445\u0440\u0430\u043D\u043D\u044B\u0445 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043D\u0438\u0439"
90713000-8: "\u041A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0442\u0438\u0432\u043D\u044B\u0435 \u0443\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u043F\u0440\u043E\u0431\u043B\u0435\u043C\u0430\u043C \u043E\u043A\u0440\u0443\u0436\u0430\u044E\u0449\u0435\u0439 \u0441\u0440\u0435\u0434\u044B"
90713100-9: "\u041A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0442\u0438\u0432\u043D\u044B\u0435 \u0443\u0441\u043B\u0443\u0433\u0438 \u0432 \u043E\u0431\u043B\u0430\u0441\u0442\u0438 \u0432\u043E\u0434\u043E\u0441\u043D\u0430\u0431\u0436\u0435\u043D\u0438\u044F \u0438 \u043A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0442\u0438\u0432\u043D\u044B\u0435 \u0443\u0441\u043B\u0443\u0433\u0438 \u043F\u043E \u0432\u043E\u043F\u0440\u043E\u0441\u0430\u043C \u0441\u0442\u043E\u0447\u043D\u044B\u0445 \u0432\u043E\u0434, \u043E\u0442\u043B\u0438\u0447\u043D\u044B\u0445 \u043E\u0442 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0445"
90714000-5: "\u042D\u043A\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u0430\u0443\u0434\u0438\u0442"
90714100-6: "\u042D\u043A\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0435 \u0441\u0438\u0441\u0442\u0435\u043C\u044B"
